$.an5=A.aR([1,"L\xe0 l\xe1 s\u1ed1 0, The Fool kh\u1edfi \u0111\u1ea7u cho b\u1ed9 \u1ea8n ch\xednh, tuy nhi\xean l\u1ea1i c\xf3 ch\xfat t\xe1ch bi\u1ec7t kh\u1ecfi nh\u1eefng l\xe1 kh\xe1c. Trong cung \u0111\xecnh th\u1eddi Trung c\u1ed5, nh\u1eefng anh h\u1ec1 l\xe0 m\u1ed9t ng\u01b0\u1eddi kh\xf4ng ph\u1ea3i tu\xe2n theo lu\u1eadt l\u1ec7 nh\u01b0 ng\u01b0\u1eddi kh\xe1c. Anh ta c\xf3 th\u1ec3 quan s\xe1t v\xe0 r\u1ed3i ch\u1ecdc c\u01b0\u1eddi. \u0110i\u1ec1u n\xe0y khi\u1ebfn The Fool kh\xf4ng th\u1ec3 \u0111o\xe1n \u0111\u1ecbnh \u0111\u01b0\u1ee3c v\xe0 \u0111\u1ea7y nh\u1eefng b\u1ea5t ng\u1edd. Anh ta nh\u1eafc ch\xfang ta nh\u1edb v\u1ec1 nh\u1eefng ti\u1ec1m n\u0103ng v\xf4 h\u1ea1n v\xe0 t\xednh t\u1ef1 ph\xe1t c\u1ed1 h\u1eefu trong m\u1ed7i ph\xfat gi\xe2y. L\xe1 b\xe0i n\xe0y mang c\u1ea3m gi\xe1c r\u1eb1ng m\u1ecdi th\u1ee9 \u0111\u1ec1u \u0111i t\u1edbi \u2013 kh\xf4ng c\xf3 g\xec l\xe0 ch\u1eafc ch\u1eafn hay theo l\u1ec7 th\u01b0\u1eddng. The Fool b\u1ed5 sung s\u1ef1 m\u1edbi m\u1ebb v\xe0 l\u1ea1 l\u1eabm v\xe0o t\xecnh hu\u1ed1ng.",2,"The Magician l\xe0 nguy\xean m\u1eabu c\u1ee7a nguy\xean l\xfd nam t\xednh, ch\u1ee7 \u0111\u1ed9ng \u2013 ng\u01b0\u1eddi \u0111\u1ea1t m\u1ee5c ti\xeau cu\u1ed1i c\xf9ng. Anh bi\u1ec3u tr\u01b0ng cho s\u1ee9c m\u1ea1nh v\u1ed7 nh\u1eb9 l\xean nh\u1eefng th\u1ebf l\u1ef1c c\u1ee7a v\u0169 tr\u1ee5 v\xe0 d\xf9ng ch\xfang cho m\u1ee5c \u0111\xedch s\xe1ng t\u1ea1o. H\xe3y ch\xfa \xfd t\u01b0 th\u1ebf c\u1ee7a anh trong b\u1ee9c v\u1ebd. Anh ta ho\u1ea1t \u0111\u1ed9ng nh\u01b0 m\u1ed9t c\u1ed9t thu l\xf4i \u2013 m\u1ed9t tay du\u1ed7i l\xean tr\xean t\u1edbi \u0110\u1ea5ng Linh Thi\xeang \u0111\u1ec3 t\xecm ki\u1ebfm c\u1ea3m h\u1ee9ng, tay kia ch\u1ec9 xu\u1ed1ng Tr\xe1i \u0110\u1ea5t \u0111\u1ec3 truy\u1ec1n s\u1ee9c m\u1ea1nh \u0111\u1ea7y uy l\u1ef1c n\xe0y. \u0110\xf4i khi kh\u1ea3 n\u0103ng c\u1ee7a anh c\xf2n c\xf3 ph\xe9p m\xe0u v\xec \xfd ch\xed c\u1ee7a anh s\u1ebd gi\xfap anh ta \u0111\u1ea1t \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u c\xf3 v\u1ebb th\u1ea7n k\u1ef3.",3,"The High Priestess l\xe0 ng\u01b0\u1eddi gi\xe1m h\u1ed9 c\u1ee7a v\xf4 th\u1ee9c. Ng\u01b0\u1eddi ng\u1ed3i tr\u01b0\u1edbc b\u1ee9c m\xe0n m\u1ea3nh c\u1ee7a tr\u1ea1ng th\xe1i v\xf4 \u0111\u1ecbnh, th\u1ee9 duy nh\u1ea5t ng\u0103n c\xe1ch con ng\u01b0\u1eddi ch\xfang ta v\u1edbi th\u1ebf gi\u1edbi b\xean trong c\u1ee7a m\u1ed7i ng\u01b0\u1eddi. \u1ea8n ch\u1ee9a b\xean trong ng\u01b0\u1eddi l\xe0 b\xed m\u1eadt c\u1ee7a v\u1ea1n v\u1eadt v\xe0 l\u1eb7ng im chuy\u1ec3n \u0111\u1ebfn ta th\xf4ng \u0111i\u1ec7p :\u201dH\xe3y \u1edf y\xean \u0111\xf3 v\xe0 bi\u1ebft r\u1eb1ng ta ch\xednh l\xe0 Ch\xfaa Tr\u1eddi.\u201d",4,"The Empress and the High Priestess l\xe0 hai n\u1eeda c\u1ee7a nh\xe2n t\u1ed1 n\u1eef trong b\u1ed9 \u1ea4n Ch\xednh. The Empress bi\u1ec3u th\u1ecb s\u1ef1 sinh s\xf4i n\u1ea3y n\u1edf, ng\u01b0\u1eddi M\u1eb9 sinh ra s\u1ef1 s\u1ed1ng, ng\u1ef1 tr\u1ecb thi\xean nhi\xean tr\xf9 ph\xfa v\xe0 nh\u1ecbp \u0111i\u1ec7u c\u1ee7a Tr\xe1i \u0110\u1ea5t. T\u1eeb Ng\u01b0\u1eddi to\u1ea3 ra t\u1ea5t c\u1ea3 s\u1ef1 m\xe3n nguy\u1ec7n v\xe0 ni\u1ec1m vui c\u1ee7a cu\u1ed9c s\u1ed1ng c\u0169ng nh\u01b0 s\u1ef1 \u1edf m\u1ecdi kh\xeda c\u1ea1nh m\xe0 cu\u1ed9c s\u1ed1ng mang t\u1edbi. The Empress khuy\u1ebfn kh\xedch b\u1ea1n t\u0103ng c\u01b0\u1eddng m\u1ed1i li\xean k\u1ebft v\u1edbi t\u1ef1 nhi\xean, n\u1ec1n t\u1ea3ng c\u1ee7a v\u1ea1n v\u1eadt. R\u1ea5t nhi\u1ec1u khi s\u1ef1 h\xe0o nho\xe1ng, b\xf3ng b\u1ea9y b\xean ngo\xe0i t\xe1ch r\u1eddi ch\xfang ta kh\u1ecfi n\u1ec1n t\u1ea3ng c\u1ee7a s\u1ef1 s\u1ed1ng. H\xe3y \u0111\u1ec3 The Empress nh\u1eafc nh\u1edf b\u1ea1n v\u1ec1 m\u1ed1i li\xean k\u1ebft m\xe0 b\u1ea1n lu\xf4n c\xf3 v\u1edbi cu\u1ed9c s\u1ed1ng.",5,"The Emperor t\u01b0\u1ee3ng tr\u01b0ng cho c\u1ea5u tr\xfac, tr\u1eadt t\u1ef1 v\xe0 lu\u1eadt l\u1ec7 \u2013 quy\u1ec1n l\u1ef1c b\u1eaft bu\u1ed9c c\xf3 \u0111\u1ec3 \u0111\u1ed1i tr\u1ecdng l\u1ea1i d\xf2ng ch\u1ea3y t\u1ef1 do c\u1ee7a s\u1ef1 tr\xf9 ph\xfa n\u01a1i The Empress. Ng\xe0i ch\u1ee7 tr\u01b0\u01a1ng m\u1ed9t th\u1ebf gi\u1edbi tr\u1eadt t\u1ef1 m\xe0 \u1edf \u0111\xf3 xe l\u1eeda lu\xf4n \u0111\xfang gi\u1edd, tr\xf2 ch\u01a1i lu\xf4n theo lu\u1eadt v\xe0 ng\u01b0\u1eddi thi h\xe0nh c\xf4ng v\u1ee5 ph\u1ea3i \u0111\u01b0\u1ee3c t\xf4n tr\u1ecdng. Trong nh\u1eefng t\xecnh hu\u1ed1ng h\u1ed7n lo\u1ea1n, The Emperor c\xf3 th\u1ec3 ch\u1ec9 ra \u0111\xe2u l\xe0 c\xe1i t\u1ed5 ch\u1ee9c th\u1ef1c s\u1ef1 c\u1ea7n. Th\u1eaft ch\u1eb7t m\u1ecdi m\u1eb7t, tr\xf3i ch\u1eb7t th\xe0nh ph\u1ea7n n\u1ed5i lo\u1ea1n. Trong tr\u01b0\u1eddng h\u1ee3p m\u1ecdi th\u1ee9 v\u1ed1n \u0111\xe3 ngo\xe0i t\u1ea7m ki\u1ec3m so\xe1t, Ng\xe0i ch\u1eafc ch\u1eafn s\u1ebd t\xecm ra h\u01b0\u1edbng \u0111\u1ec3 l\xe0m m\u1ecdi c\xe1ch ki\u1ec3m so\xe1t tr\u1edf l\u1ea1i m\u1ecdi th\u1ee9.",6,"Tr\u1eeb nh\u1eefng tr\u01b0\u1eddng h\u1ee3p hi\u1ebfm hoi, th\xf4ng th\u01b0\u1eddng th\xec m\u1ed7i ng\u01b0\u1eddi \u0111\u1ec1u tr\u01b0\u1edfng th\xe0nh v\xe0 ph\xe1t tri\u1ec3n trong m\u1ed9t m\xf4i tr\u01b0\u1eddng v\u0103n ho\xe1. Ch\xfang ta h\u1ecdc b\u1eb1ng c\xe1ch chung s\u1ed1ng v\u1edbi ng\u01b0\u1eddi kh\xe1c. The Hierophant t\u01b0\u1ee3ng tr\u01b0ng cho vi\u1ec7c h\u1ecdc h\u1ecfi ch\xednh th\u1ed1ng, \u0111\u1eb7c bi\u1ec7t l\xe0 theo nh\xf3m. The Hierophant l\xe0 ng\u01b0\u1eddi c\xf3 kh\u1ea3 n\u0103ng di\u1ec5n d\u1ecbch nh\u1eefng ki\u1ebfn th\u1ee9c b\xed \u1ea9n. Tr\xean l\xe1 b\xe0i ta nh\xecn th\u1ea5y khung c\u1ea3nh nh\xe0 th\u1edd truy\u1ec1n th\u1ed1ng. Nh\xe2n v\u1eadt Nh\xe0 t\u01b0 t\u1ebf \u0111ang m\u1eb7c b\u1ed9 l\u1ec5 ph\u1ee5c l\u1ed9ng l\u1eaby. Tr\xe1ch nhi\u1ec7m c\u1ee7a \xf4ng l\xe0 l\xe0m l\u1ec5 k\u1ebft n\u1ea1p cho hai ng\u01b0\u1eddi \u0111\xe3 th\u1ee5 gi\xe1o \u0111\u1ec3 sau \u0111\xf3 h\u1ecd c\xf3 th\u1ec3 nh\u1eadn l\xe3nh tr\xe1ch nhi\u1ec7m c\u1ee7a m\xecnh.",7,"The Lovers l\xe0 m\u1ed9t l\xe1 b\xe0i d\u1ec5 nh\u1edb. T\xecnh y\xeau v\xe0 t\xecnh d\u1ee5c lu\xf4n l\xe0 ch\u1ee7 \u0111\u1ec1 thu h\xfat, v\xe0 nh\u01b0 b\u1ea1n mong \u0111\u1ee3i, l\xe1 b\xe0i n\xe0y t\u01b0\u1ee3ng tr\u01b0ng cho c\u1ea3 hai. Th\xf4i th\xfac ho\xe0 h\u1ee3p r\u1ea5t m\u1ea1nh m\u1ebd v\xe0 \u1edf d\u1ea1ng cao nh\u1ea5t, l\xe0m ch\xfang ta v\u01b0\u1ee3t ra kh\u1ecfi b\u1ea3n th\xe2n. \u0110\xf3 l\xe0 l\xfd do v\xec sao thi\xean th\u1ea7n \u0111ang ban ph\xfac cho m\u1ed1i li\xean k\u1ebft gi\u1eefa ng\u01b0\u1eddi \u0111\xe0n \xf4ng v\xe0 ng\u01b0\u1eddi ph\u1ee5 n\u1eef trong.",8,"The Chariot mang H\xecnh \u1ea3nh Julius Caesar tr\xean chi\u1ebfc chi\u1ebfn xa huy ho\xe0ng ti\u1ebfn v\xe0o th\xe0nh Roma. \xd4ng \u0111\xe3 \u0111\xe1nh b\u1ea1i k\u1ebb th\xf9 v\xe0 thu v\u1ec1 nhi\u1ec1u chi\u1ebfn l\u1ee3i ph\u1ea9m v\xe0 \u0111\u1ea5t \u0111ai. \u0110\xe2y l\xe0 linh h\u1ed3n c\u1ee7a The Chariot. L\xe1 b\xe0i s\u1ed1 7 t\u01b0\u1ee3ng tr\u01b0ng cho vinh quang c\xf3 \u0111\u01b0\u1ee3c qua \u01b0\u1edbc mu\u1ed1n m\u1ea1nh m\u1ebd v\xe0 t\xednh c\xe1 nh\xe2n cao \u0111\u1ed9.  H\xecnh \u1ea3nh qu\xe2n \u0111\u1ed9i ho\xe0n to\xe0n ph\xf9 h\u1ee3p v\u1edbi The Chariot v\xec l\xe1 b\xe0i n\xe0y g\u1eafn v\u1edbi s\u1ee9c m\u1ea1nh chinh ph\u1ee5c \u2013 k\u1ec9 lu\u1eadt, quy\u1ebft t\xe2m s\u1eaft \u0111\xe1 v\xe0 s\u1ef1 quy\u1ebft \u0111o\xe1n.",9,"Th\u01b0\u1eddng th\xec ch\xfang ta ngh\u0129 \u0111\u1ebfn kh\xe1i ni\u1ec7m s\u1ee9c m\u1ea1nh l\xe0 th\u1ec3 ch\u1ea5t \u2013 tay to, ng\u1ef1c b\u1ef1, ch\xe2n kho\u1ebb \u2013 nh\u01b0ng c\xf2n s\u1ee9c m\u1ea1nh t\u1eeb b\xean trong th\xec sao? S\u1ee9c m\u1ea1nh b\xean trong \u0111\u1ebfn t\u1eeb luy\u1ec7n t\u1eadp c\u01a1 b\u1eafp c\u1ee7a tr\xe1i tim. S\u1ee9c m\u1ea1nh \u0111\xf3 \u0111\u1ebfn t\u1eeb s\u1ef1 nh\u1eabn n\u1ea1i, ki\xean tr\xec, l\xf2ng qu\u1ea3 c\u1ea3m, quy\u1ebft t\xe2m v\xe0 s\u1ef1 \u0111i\u1ec1m t\u0129nh \u2013 nh\u1eefng ph\u1ea9m ch\u1eaft gi\xfap ch\xfang ta tr\u1ee5 v\u1eefng khi gi\xf4ng t\u1ed1 \u0111\u1ebfn. Tr\u01b0\u1edbc \u0111\xe2y, nh\u1eefng ng\u01b0\u1eddi c\xf3 s\u1ee9c m\u1ea1nh b\xean trong th\u01b0\u1eddng \u0111\u01b0\u1ee3c g\u1ecdi l\xe0 nh\u1eefng ng\u01b0\u1eddi c\xf3 c\xe1 t\xednh, \u0111\xf3 l\xe0 ng\u01b0\u1eddi b\u1ea1n c\xf3 th\u1ec3 tin t\u01b0\u1edfng trong nh\u1eefng gi\u1edd ph\xfat \u0111en t\u1ed1i nh\u1ea5t. Nh\u1eefng l\xe1 b\xe0i s\u1ed1 8 t\u01b0\u1ee3ng tr\u01b0ng cho n\u0103ng l\u01b0\u1ee3ng n\xe0y, n\u0103ng l\u01b0\u1ee3ng c\u1ee7a s\u1ef1 quy\u1ebft t\xe2m trong t\u0129nh l\u1eb7ng. Strength kh\xf4ng ph\u1ea3i l\xe0 l\xe1 b\xe0i h\xe0o nho\xe1ng, m\xe0 l\xe0 l\xe1 b\xe0i c\u1ee7a s\u1ef1 tin c\u1eady v\xe0 v\u1eefng ch\xe3i.",10,"\u1ea8n s\u0129 th\xf4ng th\u01b0\u1eddng \u0111\u01b0\u1ee3c nh\xecn nh\u01b0 nh\u1eefng ng\u01b0\u1eddi c\xe1u b\u1eb3n, r\xe2u t\xf3c l\xf9m x\xf9m, t\xe1ch xa x\xe3 h\u1ed9i \u0111\u1ec3 s\u1ed1ng cu\u1ed9c \u0111\u1eddi kh\u1ed5 h\u1ea1nh. Nh\u1eefng l\xe1 b\xe0i s\u1ed1 9 \u0111i theo h\u01b0\u1edbng hi\u1ec3u n\xe0y. The Hermit t\u01b0\u1ee3ng tr\u01b0ng cho mong mu\u1ed1n t\xe1ch r\u1eddi kh\u1ecfi th\u1ebf gi\u1edbi b\xean ngo\xe0i v\xe0 t\u1eadp trung v\xe0o th\u1ebf gi\u1edbi b\xean trong. \xd4ng t\xecm c\xe2u tr\u1ea3 l\u1eddi t\u1eeb b\xean trong v\xe0 bi\u1ebft r\u1eb1ng c\xe2u tr\u1ea3 l\u1eddi ch\u1ec9 \u0111\u1ebfn t\u1eeb s\u1ef1 t\u0129nh l\u1eb7ng v\xe0 c\xf4 \u0111\u1ed9c.",11,"Wheel of Fortune l\xe0 m\u1ed9t trong s\u1ed1 r\u1ea5t \xedt nh\u1eefng l\xe1 b\xe0i trong b\u1ed9 \u1ea4n Ch\xednh kh\xf4ng c\xf3 tr\u1ecdng t\xe2m l\xe0 con ng\u01b0\u1eddi. \u0110\xf3 l\xe0 b\u1edfi v\xec tr\u1ecdng t\xe2m c\u1ee7a l\xe1 b\xe0i n\xe0y n\u1eb1m tr\xean c\u1ea3 l\u0129nh v\u1ef1c thu\u1ed9c v\u1ec1 con ng\u01b0\u1eddi \u2013 n\xf3 \u1edf m\u1ed9t t\u1ea7m cao h\u01a1n (nh\u1eefng \u0111\xe1m m\xe2y), n\u01a1i m\xe0 v\u1eadn m\u1ec7nh c\u1ee7a m\u1ecdi \u0111\xe0n \xf4ng v\xe0 ph\u1ee5 n\u1eef \u0111an xen v\xe0o nhau t\u1ea1o th\xe0nh t\u1ea5m th\u1ea3m cu\u1ed9c s\u1ed1ng. B\xe0i Tarot x\xe1c \u0111\u1ecbnh r\u1eb1ng m\u1ed7i ng\u01b0\u1eddi s\u1ebd t\u1ef1 ch\u1ecdn con \u0111\u01b0\u1eddng cho m\xecnh, nh\u01b0ng v\u1eabn h\xe0m \xfd n\u1eb1m trong m\u1ed9t v\xf2ng tr\xf2n t\u1ed5ng th\u1ec3 l\u1edbn h\u01a1n. Ch\xfang ta g\u1eb7p nh\u1eefng s\u1ef1 vi\u1ec7c, c\u01a1 h\u1ed9i, bi\u1ebfn c\u1ed1 m\xe0 ta ngh\u0129 l\xe0 \u201ctai n\u1ea1n\u201d nh\u01b0ng th\u1eadt ra n\xf3 th\u1eadt ra l\xe0 m\u1ed9t ph\u1ea7n c\u1ee7a b\u1ee9c tranh t\u1ed5ng th\u1ec3 \u0111\xe3 \u0111\u01b0\u1ee3c l\xean k\u1ebf ho\u1ea1ch.",12,"Tr\xean l\xe1 11 l\xe0 h\xecnh \u1ea3nh th\u01b0\u1eddng th\u1ea5y c\u1ee7a Justice. M\u1ed9t tay n\u1eafm gi\u1eef c\xe1n c\xe2n c\xf4ng l\xfd, v\xe0 thanh ki\u1ebfm ph\xe1n quy\u1ebft \u1edf tay c\xf2n l\u1ea1i. Trong tarot, Justice t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 nh\u1eadn bi\u1ebft r\u1eb1ng cu\u1ed9c s\u1ed1ng lu\xf4n c\xf4ng b\u1eb1ng. Tuy nhi\xean, cu\u1ed9c s\u1ed1ng h\xe0ng ng\xe0y v\u1edbi qu\xe1 nhi\u1ec1u \u0111i\u1ec1u th\u1ea5t th\u01b0\u1eddng l\u1ea1i lu\xf4n khi\u1ebfn ch\xfang ta ph\u1ea3i nghi ng\u1edd \u0111i\u1ec1u n\xe0y, Justice nh\u1eafc ch\xfang ta nh\u1edb l\u1ea1i \u0111i\u1ec3m c\xe2n b\u1eb1ng lu\xf4n t\u1ed3n t\u1ea1i. H\xe3y ch\xfa \xfd \u0111i\u1ec3m t\u01b0\u01a1ng \u0111\u1ed3ng gi\u1eefa Justice v\xe0 The Emperor. C\u1ea3 hai \u0111\u1ec1u t\u01b0\u1ee3ng tr\u01b0ng cho tr\u1eadt t\u1ef1 trong v\u0169 tr\u1ee5; The Emperor trong tr\u1eadt t\u1ef1 c\u1ee7a th\u1ebf gi\u1edbi, c\xf2n Justice l\u1ea1i trong quy lu\u1eadt nh\xe2n qu\u1ea3.",13,"B\xe0i h\u1ecdc l\u1edbn nh\u1ea5t c\u1ee7a The Hanged Man ch\xednh l\xe0 ch\xfang ta \u201cki\u1ec3m so\xe1t\u201d khi ch\xfang ta bi\u1ebft bu\xf4ng tay, ch\xfang ta \u201cth\u1eafng\u201d khi bi\u1ebft nh\u1eadn thua. H\xecnh \u1ea3nh tr\xean l\xe1 s\u1ed1 12 \u0111\xe3 t\u1ea1o ra s\u1ef1 \u0111\u1ea7u h\xe0ng tri\u1ec7t \u0111\u1ec3 \u2013 ch\u1ebft tr\xean thanh th\u1eadp gi\xe1 \u2013 v\xe0 to\u1ea3 ra v\u1ea7ng h\xe0o quang chi\u1ebfn th\u1eafng ho\xe0n m\u1ef9. Hy sinh b\u1ea3n th\xe2n v\xe0 tr\u1edf th\xe0nh ng\u01b0\u1eddi chi\u1ebfn th\u1eafng. The Hanged Man c\u0169ng n\xf3i v\u1edbi ch\xfang ta r\u1eb1ng, ch\xfang ta ti\u1ebfn l\xean nh\u1edd bi\u1ebft c\xe1ch \u0111\u1ee9ng l\u1ea1i. B\u1eb1ng c\xe1ch ng\u1eebng l\u1ea1i, ch\xfang ta c\xf3 \u0111\u01b0\u1ee3c th\u1eddi gian c\u1ee7a c\u1ea3 v\u0169 tr\u1ee5.",14,"C\xe1i Ch\u1ebft! Th\u1eadt s\u1ef1 l\xe0 m\u1ed9t ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng qu\xe1 m\u1ea1nh. Ai c\xf3 th\u1ec3 nh\xecn v\xe0o h\xecnh \u1ea3nh \u0111en t\u1ed1i ch\u1ebft ch\xf3c c\u1ee7a b\u1ed9 x\u01b0\u01a1ng tr\xean l\xe1 b\xe0i s\u1ed1 13 m\xe0 kh\xf4ng c\u1ea3m th\u1ea5y r\u1ee3n ng\u01b0\u1eddi? T\u1ea1i \u0111\xe2y ch\xfang ta \u0111\u1ed1i m\u1eb7t v\u1edbi n\u1ed7i s\u1ee3 h\xe3i l\u1edbn nh\u1ea5t c\u1ee7a m\xecnh \u2013 b\xed \u1ea9n l\u1edbn nh\u1ea5t m\xe0 ta ch\u1eb3ng th\u1ec3 bi\u1ebft \u0111\u01b0\u1ee3c. Ch\xfang ta b\u1ea5t gi\xe1c gi\u1eadt ng\u01b0\u1eddi l\u1ea1i tr\u01b0\u1edbc C\xe1i Ch\u1ebft, b\u1edfi v\xec ch\xfang ta nh\xecn n\xf3 nh\u01b0 m\u1ed9t s\u1ef1 h\u1ee7y di\u1ec7t. Trong tarot (v\xe0 c\u1ea3 trong cu\u1ed9c s\u1ed1ng n\u1eefa) C\xe1i Ch\u1ebft kh\xf4ng ph\u1ea3i l\xe0 c\xe1i k\u1ebft cu\u1ed1i c\xf9ng, m\xe0 l\xe0 s\u1ef1 chuy\u1ec3n m\xecnh sang giai \u0111o\u1ea1n ti\u1ebfp theo. B\u1ea3n ch\u1ea5t cu\u1ed9c s\u1ed1ng l\xe0 v\u0129nh c\u1eedu, c\xe1ch n\xe0y hay c\xe1ch kh\xe1c. Ph\xe1t tri\u1ec3n, chuy\u1ec3n \u0111\u1ed9ng, v\xe0 \u0111\u1ec3 s\u1ed1ng \u2013 ch\xfang ta ph\u1ea3i \u201ck\u1ebft th\xfac\u201d c\xe1i c\u0169 \u0111\u1ec3 nh\u01b0\u1eddng \u0111\u01b0\u1eddng cho c\xe1i m\u1edbi.",15,"Ch\u01b0\u0300ng m\u01b0\u0323c la\u0300 th\xea\u0309 hi\xea\u0323n kha\u0309 n\u0103ng ti\xea\u0301t ch\xea\u0301 va\u0300 ki\xea\u0300m ch\xea\u0301 ba\u0309n th\xe2n. Trong m\xf4\u0323t th\xea\u0301 gi\u01a1\u0301i \u0111\xe2\u0300y r\xe2\u0303y nh\u01b0\u0303ng \u0111am m\xea l\xf4i cu\xf4\u0301n, ta c\xe2\u0300n thi\xea\u0301t pha\u0309i ti\u0300m th\xe2\u0301y gi\u01a1\u0301i ha\u0323n c\xe2n b\u1eb1ng cho mi\u0300nh. Co\u0301 th\xea\u0309 xe\u0301t \u0111oa\u0301n cu\u0303ng co\u0301 chu\u0301t nha\u0300m cha\u0301n? N\u0103ng l\u01b0\u01a1\u0323ng cu\u0309a Temperance d\u01b0\u01a1\u0300ng nh\u01b0 co\u0301 th\xea\u0309 kh\xf4ng g\xe2y ki\u0301ch \u0111\xf4\u0323ng \u01a1\u0309 b\xean ngoa\u0300i, ma\u0300 mang t\xednh y\xean bi\u0300nh cu\u0309a t\xe2m ba\u0303o. Mo\u0323i th\u01b0\u0301 xung quanh \u0111ang khu\u1ea5y \u0111\xf4\u0323ng l\xean, nh\u01b0ng \u01a1\u0309 trung t\xe2m no\u0301 v\xe2\u0303n la\u0300 m\xf4\u0323t \u0111i\xea\u0309m gi\u01b0\u0303 cho mo\u0323i th\u01b0\u0301 \u0111\u01b0\u01a1\u0323c c\xe2n b\u0103\u0300ng.",16,"Lucifer, Mephistopheles, Satan, Hoa\u0300ng T\u01b0\u0309 Bo\u0301ng \u0110\xeam. B\xe2\u0301t c\u01b0\u0301 t\u01b0\u0300 gi\u0300 chu\u0301ng ta d\xf9ng \u0111\u1ec3 go\u0323i \xf4ng ta \u0111i n\u1eefa th\xec The Devil v\u1eabn s\u1ebd lu\xf4n la\u0300 bi\xea\u0309u t\u01b0\u01a1\u0323ng v\xea\u0300 nh\u01b0\u0303ng \u0111i\u1ec1u x\xe2\u0301u xa va\u0300 kh\xf4ng mong mu\xf4\u0301n. T\u01b0\u0300 khi\u0301a ca\u0323nh con ng\u01b0\u01a1\u0300i, chu\u0301ng ta se\u0303 th\xe2\u0301y th\xea\u0301 gi\u01a1\u0301i la\u0300 m\xf4\u0323t cu\xf4\u0323c \u0111\xe2\u0301u tranh gi\u01b0\u0303a \xe1nh sa\u0301ng va\u0300 b\xf3ng t\xf4\u0301i. Chu\u0301ng ta mu\xf4\u0301n \u0111a\u0301nh ba\u0323i \u0111\u01b0\u01a1\u0323c ca\u0301i x\xe2\u0301u \u0111\xea\u0309 ca\u0301i t\xf4\u0301t chi\xea\u0301m \u01b0u th\xea\u0301. Th\u01b0\u0323c t\xea\u0301, t\xf4\u0301t va\u0300 x\xe2\u0301u kh\xf4ng th\xea\u0309 ta\u0301ch r\u01a1\u0300i, cu\u0303ng gi\xf4\u0301ng nh\u01b0 ba\u0323n kh\xf4ng th\xea\u0309 c\u0103\u0301t ca\u0301i bo\u0301ng ra kho\u0309i v\xe2\u0323t th\xea\u0309 cu\u0309a no\u0301. Bo\u0301ng t\xf4\u0301i \u0111\u01a1n gia\u0309n la\u0300 s\u01b0\u0323 thi\xea\u0301u a\u0301nh sa\u0301ng, va\u0300 no\u0301 \u0111\u01b0\u01a1\u0323c ta\u0323o ra b\u01a1\u0309i nh\u01b0\u0303ng sai l\xe2\u0300m cu\u0309a vi\xea\u0323c gi\xe2\u0301u di\xea\u0301m s\u01b0\u0323 th\xe2\u0323t. La\u0301 ba\u0300i s\xf4\u0301 15 na\u0300y cho chu\u0301ng ta th\xe2\u0301y nh\u01b0\u0303ng sai l\xe2\u0300m \u0111o\u0301.",17,"The Tower la\u0300 m\xf4\u0323t la\u0301 ba\u0300i \u0111a\u0301ng lo nga\u0323i. L\u01b0\u0309a, s\xe2\u0301m ch\u01a1\u0301p, va\u0300 nh\u01b0\u0303ng ta\u0309ng \u0111a\u0301 \u0111\xf4\u0309 v\u01a1\u0303 \u2013 hoa\u0300n toa\u0300n l\xe0 khung c\u1ea3nh c\u1ee7a m\u1ed9t r\u0103\u0301c r\xf4\u0301i l\u1edbn! La\u0301 ba\u0300i s\xf4\u0301 16 se\u0303 kh\xf4ng \u0111\u01b0\u01a1\u0323c cha\u0300o \u0111o\u0301n b\u01a1\u0309i nh\u01b0\u0303ng ai kh\xf4ng thi\u0301ch s\u01b0\u0323 thay \u0111\xf4\u0309i. No\u0301 \u0111a\u0323i di\xea\u0323n cho m\xf4\u0323t chuy\xea\u0309n di\u0323ch l\u01a1\u0301n, \u0111\xf4\u0323t ng\xf4\u0323t ho\u0103\u0323c \u0111a\u0309o ng\u01b0\u01a1\u0323c c\u1ee7a v\xe2\u0323n m\xea\u0323nh. Th\u01b0\u01a1\u0300ng thi\u0300 s\u01b0\u0323 thay \u0111\xf4\u0309i xa\u0309y ra d\xe2\u0300n d\xe2\u0300n, cho chu\u0301ng ta th\u01a1\u0300i gian \u0111\xea\u0309 thi\u0301ch nghi, nh\u01b0ng \u0111\xf4i khi no\u0301 xa\u0309y ra qua\u0301 nhanh cho\u0301ng va\u0300 b\xe2\u0301t thi\u0300nh li\u0300nh. \u0110\xe2y la\u0300 a\u0309nh h\u01b0\u01a1\u0309ng cu\u0309a The Tower.",18,"Con ng\u01b0\u1eddi lu\xf4n ng\u1eafm c\xe1c v\xec sao nh\u01b0 m\u1ed9t ngu\u1ed3n c\u1ea3m h\u1ee9ng v\xe0 hy v\u1ecdng. C\xf3 m\u1ed9t \u0111i\u1ec1u g\xec \u0111\xf3 \u1edf th\u1ee9 \xe1nh s\xe1ng l\u1ea5p l\xe1nh n\xe0y thu h\xfat ch\xednh ch\xfang ta b\u01b0\u1edbc l\xean m\u1ed9t t\u1ea7ng cao h\u01a1n. Khi ch\xfang ta h\u01b0\u1edbng m\u1eaft v\u1ec1 ph\xeda thi\xean \u0111\xe0ng, ch\xfang ta kh\xf4ng c\xf2n c\u1ea3m th\u1ea5y n\u1ed7i bu\u1ed3n kh\u1ed5 \u1edf \u0111\u1ecba gi\u1edbi n\u1eefa. L\xe1 b\xe0i The Star nh\u1eafc nh\u1edf ch\xfang ta v\u1ec1 ti\u1ebfng g\u1ecdi to r\xf5 c\u1ee7a m\u1ed9t ng\u01b0\u1eddi mang t\xf4ng gi\u1ecdng cao. C\xf3 m\u1ed9t \u0111i\u1ec1u g\xec \u0111\xf3 thu\u1ed9c v\u1ec1 th\u1ebf gi\u1edbi kh\xe1c. T\u1ea5t c\u1ea3 kh\xf3 kh\u0103n v\xe0 v\u1eadt ch\u1ea5t trong cu\u1ed9c s\u1ed1ng m\u1ed7i ng\xe0y \u0111\u01b0\u1ee3t g\u1ed9t b\u1ecf ch\u1ec9 c\xf2n l\u1ea1i linh h\u1ed3n thanh khi\u1ebft nh\u1ea5t. Sau khi ti\u1ebfp x\xfac v\u1edbi The Star, ch\xfang ta c\u1ea3m th\u1ea5y nh\u01b0 \u0111\u01b0\u1ee3c n\xe2ng \u0111\u1ee1 v\xe0 ph\xf9 h\u1ed9.",19,"N\u1ebfu b\xe2y gi\u1edd b\u1ea1n nh\xecn quanh ph\xf2ng, b\u1ea1n (c\xf3 th\u1ec3!) s\u1ebd th\u1ea5y m\u1ecdi ng\u01b0\u1eddi v\xe0 \u0111\u1ed3 v\u1eadt \u0111ang tho\u1ea3i m\xe1i v\u1edbi v\u1ecb tr\xed quen thu\u1ed9c c\u1ee7a h\u1ecd/c\u1ee7a ch\xfang. M\u1ecdi th\u1ee9 \u0111ang \u0111\xfang trong khu\xf4n kh\u1ed5 nh\u01b0 b\u1ea1n mu\u1ed1n. B\u1ea1n bi\u1ebft r\u1eb1ng n\u1ebfu b\u1ea1n nh\u1eafm m\u1eaft l\u1ea1i v\xe0 l\u1ea1i m\u1edf ra, c\u0103n ph\xf2ng s\u1ebd v\u1eabn nh\u01b0 v\u1eady. Nh\u01b0ng\u2026 b\u1ea1n c\xf3 bao gi\u1edd c\u1ea3m th\u1ea5y m\u1ed9t n\u01a1i n\xe0o \u0111\xf3 m\u1ea5t \u0111i s\u1ef1 th\xe2n qu\xean m\xe0 thay v\xe0o \u0111\xf3 l\xe0 m\u1ed9t th\u1ebf gi\u1edbi kh\xe1c th\u01b0\u1eddng \u0111\u1ebfn m\u1ee9c b\u1ea1n kh\xf4ng th\u1ec3 hi\u1ec3u n\u1ed5i kh\xf4ng? \u0110\xf3 ch\xednh l\xe0 tr\u1ea3i nghi\u1ec7m c\u1ee7a the Moon.",20,"Trong su\u1ed1t l\u1ecbch s\u1eed, ng\u01b0\u1eddi ta vinh danh M\u1eb7t tr\u1eddi l\xe0 ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng c\u1ee7a \xe1nh s\xe1ng v\xe0 s\u1ef1 \u1ea5m \xe1p. Trong truy\u1ec1n thuy\u1ebft c\u1ee7a nhi\u1ec1u n\u1ec1n v\u0103n h\xf3a, M\u1eb7t tr\u1eddi l\xe0 \u0111\u1ea5ng t\u1ed1i cao \u2013 lu\xf4n tr\xe0n \u0111\u1ea7y s\u1ee9c m\u1ea1nh v\xe0 b\u1ea3n l\u0129nh. M\u1eb7t tr\u1eddi l\xe0 ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng thi\u1ebft y\u1ebfu \u0111\u1ec3 cho s\u1ef1 s\u1ed1ng tr\xean tr\xe1i \u0111\u1ea5t t\u1ed3n t\u1ea1i. Trong tarot, l\xe1 the Sun t\u01b0\u1ee3ng tr\u01b0ng cho sinh l\u1ef1c v\xe0 s\u1ef1 tr\xe1ng l\u1ec7. L\xe1 the Sun ch\u1eafc ch\u1eafn kh\xf4ng ph\u1ea3i l\xe0 m\u1ed9t l\xe1 b\xe0i c\u1ee7a s\u1ef1 ngoan ngo\xe3n v\xe0 ngh\u1ec9 ng\u01a1i.",21,"Tr\xean l\xe1 b\xe0i 20, ch\xfang ta th\u1ea5y con ng\u01b0\u1eddi v\u01b0\u01a1n m\xecnh l\xean theo ti\u1ebfng g\u1ecdi c\u1ee7a thi\xean s\u1ee9. \u0110\xf3 ch\xednh l\xe0 Ng\xe0y Ph\xe1n X\xe9t, khi nh\u1eefng ng\u01b0\u1eddi t\u1ed1t \u0111\u01b0\u1ee3c l\xean thi\xean \u0111\u01b0\u1eddng. Nh\u01b0ng c\xf2n nh\u1eefng ng\u01b0\u1eddi kh\xf4ng \u0111\u01b0\u1ee3c c\u1ee9u r\u1ed7i th\xec sao? H\u1ecd c\xf3 b\u1ecb ph\xe1n x\xe9t r\u1eb1ng kh\xf4ng \u0111\u1ee7 \u0111i\u1ec1u ki\u1ec7n kh\xf4ng? V\xec t\u1ed9i l\u1ed7i c\u1ee7a m\xecnh, Ch\xfaa tr\u1eddi c\xf3 t\u1eeb ch\u1ed1i h\u1ecd kh\xf4ng? \u0110\xe2y l\xe0 m\u1ed9t kh\xeda c\u1ea1nh c\u1ee7a vi\u1ec7c ph\xe1n x\xe9t m\xe0 v\u1eabn c\xf2n \u0111ang g\xe2y tranh c\xe3i. L\xe0m sao s\u1ef1 ph\xe1n x\xe9t l\u1ea1i \u0111i \u0111\xf4i v\u1edbi s\u1ef1 tha th\u1ee9?",22,"L\u1ec5 T\u1ea1 \u01a1n \u0111\xe3 \u0111\u1ebfn. B\u1ea1n v\u1eeba d\xf9ng xong m\u1ed9t b\u1eefa th\u1eadt ngon, v\xe0 \u0111ang c\u1ea7m trong tay m\u1ed9t c\u1ed1c c\xe0 ph\xea n\xf3ng h\u1ed5i. B\u1ea1n b\xe8 v\xe0 gia \u0111\xecnh \u0111ang tranh lu\u1eadn v\u1ec1 bu\u1ed5i ti\u1ec7c T\u1ea1 \u01a1n v\u1eeba r\u1ed3i, \u0111\u1ee9a b\xe9 \u1edf \u0111\u1ea7u b\xean kia b\xe0n \u0111ang g\u1ecdi b\u1ea1n, v\xe0 hai ch\xe2n b\u1ea1n \u0111ang xoa b\u1ee5ng cho m\u1ed9t ch\xfa ch\xf3 trung th\xe0nh. B\u1ea1n \u0111ang h\u1ea1nh ph\xfac, th\u1ecfa m\xe3n, v\xe0 th\u1eadt s\u1ef1 c\u1ea3m th\u1ea5y nh\u01b0 \u0111\u01b0\u1ee3c ph\xf9 h\u1ed9 (\xedt nh\u1ea5t l\xe0 cho \u0111\u1ebfn l\xfac b\u1ea1n ph\u1ea3i \u0111i r\u1eeda ch\xe9n!). Trong th\u1eddi kh\u1eafc n\xe0y, b\u1ea1n c\xf3 c\u1ea3 Th\u1ebf gi\u1edbi.",23,"Ace of Cups l\xe0 m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng v\u1ec1 ti\u1ec1m n\u0103ng trong c\xe1c l\u0129nh v\u1ef1c c\u1ea3m nh\u1eadn s\xe2u s\u1eafc, s\u1ef1 th\xe2n m\u1eadt, s\u1ef1 h\xf2a h\u1ee3p, l\xf2ng th\u01b0\u01a1ng c\u1ea3m v\xe0 t\xecnh y\xeau. Trong c\xe1c l\u01b0\u1ee3t tr\u1ea3i b\xe0i, n\xf3 cho th\u1ea5y r\u1eb1ng m\u1ed9t h\u1ea1t gi\u1ed1ng nh\u1eadn th\u1ee9c v\u1ec1 c\u1ea3m x\xfac \u0111\xe3 \u0111\u01b0\u1ee3c gieo tr\u1ed3ng trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n d\xf9 b\u1ea1n ch\u01b0a nh\u1eadn ra n\xf3 v\xe0o l\xfac n\xe0y. Khi h\u1ea1t gi\u1ed1ng n\u1ea3y m\u1ea7m, n\xf3 c\xf3 th\u1ec3 xu\u1ea5t hi\u1ec7n d\u01b0\u1edbi m\u1ecdi h\xecnh th\u1ee9c. N\xf3 c\xf3 th\u1ec3 l\xe0 s\u1ef1 h\u1ea5p d\u1eabn, nh\u1eefng c\u1ea3m x\xfac m\u1ea1nh m\u1ebd, nh\u1eadn th\u1ee9c v\u1ec1 tr\u1ef1c gi\xe1c, ho\u1eb7c m\u1ed9t ph\u1ea3n \u1ee9ng \u0111\u1ed3ng c\u1ea3m. Ngo\xe0i ra, n\xf3 c\xf3 th\u1ec3 l\xe0 m\u1ed9t \u0111\u1ec1 ngh\u1ecb, m\xf3n qu\xe0, c\u01a1 h\u1ed9i, cu\u1ed9c g\u1eb7p g\u1ee1 ho\u1eb7c m\u1ed9t s\u1ef1 ki\u1ec7n ki\u1ec3u nh\u01b0 th\u1ebf.",24,"\u0110\u1ec3 hi\u1ec3u \u0111\u01b0\u1ee3c 2 of Cups, nh\u1eefng g\xec c\xe1c b\u1ea1n ph\u1ea3i l\xe0m l\xe0 nh\xecn v\xe0o h\xecnh \u1ea3nh c\u1ee7a l\xe1 b\xe0i. M\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng v\xe0 m\u1ed9t ng\u01b0\u1eddi ph\u1ee5 n\u1eef \u0111ang nh\xecn ch\u1eb1m ch\u1eb1m v\xe0o nhau, s\u1eb5n s\xe0ng c\u1ea1n ly (c\u1ea3m x\xfac). \u0110\xe2y l\xe0 h\xecnh \u1ea3nh r\u1ea5t l\xe3ng m\u1ea1n v\xe0 g\u1ee3i thi\xean h\u01b0\u1edbng t\xecnh d\u1ee5c. Ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng gi\u1eefa hai ng\u01b0\u1eddi h\u1ecd g\u1ea7n nh\u01b0 c\xf3 th\u1ec3 th\u1ea5y v\xe0 c\u1ea3m nh\u1eadn \u0111\u01b0\u1ee3c. 2 of Cups cho th\u1ea5y v\u1ebb \u0111\u1eb9p v\xe0 s\u1ee9c m\u1ea1nh \u0111\u01b0\u1ee3c t\u1ea1o ra khi hai con ng\u01b0\u1eddi \u0111\u1ebfn v\u1edbi nhau. \u0110\xe2y l\xe0 l\xe1 b\xe0i d\xe0nh cho nh\u1eefng ng\u01b0\u1eddi \u0111ang y\xeau, v\xe0, tr\xean th\u1ef1c t\u1ebf, 2 of Cups l\xe0 m\u1ed9t l\xe1 Minor Arcana mang \xfd ngh\u0129a t\u01b0\u01a1ng \u0111\u01b0\u01a1ng c\u1ee7a l\xe1 Lovers b\u1eb1ng nhi\u1ec1u c\xe1ch hi\u1ec3u kh\xe1c nhau.",25,"Tr\xean l\xe1 n\xe0y, ch\xfang ta th\u1ea5y ba ng\u01b0\u1eddi ph\u1ee5 n\u1eef nh\u1ea3y m\xfaa c\xf9ng nhau theo m\u1ed9t v\xf2ng tr\xf2n. C\xe1nh tay c\u1ee7a h\u1ecd v\u1edbi ra, ch\u1ea1m v\xe0o nhau \u0111\u1ec3 k\u1ebft n\u1ed1i c\u1ea3m x\xfac c\u1ee7a m\xecnh (Cups). Trong nhi\u1ec1u th\u1eddi k\u1ef3 hay ch\u1ebf \u0111\u1ed9, ng\u01b0\u1eddi ph\u1ee5 n\u1eef \u0111\u1ec1u l\xe0 ng\u01b0\u1eddi t\u1ea1o ra v\xe0 nu\xf4i d\u01b0\u1ee1ng ch\u1ea5t keo x\xe3 h\u1ed9i g\u1eafn k\u1ebft m\u1ecdi ng\u01b0\u1eddi l\u1ea1i v\u1edbi nhau. Nh\u1eefng ng\u01b0\u1eddi ph\u1ee5 n\u1eef nh\u1ea3y m\xfaa l\xe0 m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a vi\u1ec7c \u0111\u1ebfn v\u1edbi nhau trong t\xecnh y\xeau. (T\u1ea5t nhi\xean, nh\u1eefng c\u1ea3m x\xfac n\xe0y kh\xf4ng ch\u1ec9 li\xean quan \u0111\u1ebfn n\u1eef gi\u1edbi.)",26,"Nh\u1eefng ng\u01b0\u1eddi th\xedch ch\xe8o thuy\u1ec1n kayak v\xe0 c\xe1c m\xf4n th\u1ec3 thao tr\xean s\xf4ng kh\xe1c \u0111\u1ec1u bi\u1ebft r\u1eb1ng c\xf3 nh\u1eefng khu v\u1ef1c tr\xean s\xf4ng d\xf2ng n\u01b0\u1edbc chuy\u1ec3n \u0111\u1ed9ng theo \u0111\u01b0\u1eddng tr\xf2n r\u1ea5t nguy hi\u1ec3m. Thay v\xec di chuy\u1ec3n v\u1ec1 ph\xeda tr\u01b0\u1edbc, d\xf2ng n\u01b0\u1edbc t\u1ef1 \u0111\u1ed9ng quay ng\u01b0\u1ee3c l\u1ea1i ch\xednh n\xf3. C\u0169ng t\u01b0\u01a1ng t\u1ef1 nh\u01b0 v\u1eady, ch\xfang ta c\u0169ng c\xf3 th\u1ec3 g\u1eb7p kh\xf3 kh\u0103n ho\u1eb7c v\u1ea5n \u0111\u1ec1 trong h\u1ec7 th\u1ed1ng c\u1ea3m x\xfac c\u1ee7a ch\xednh m\xecnh. 4 of Cups \u0111\u1ea1i di\u1ec7n cho hi\u1ec7n t\u01b0\u1ee3ng t\u1ef1 thu m\xecnh l\u1ea1i tr\u01b0\u1edbc m\u1ecdi th\u1ee9.",27,"5 of Cups l\xe0 l\xe1 b\xe0i c\u1ee7a s\u1ef1 m\u1ea5t m\xe1t. Tr\xean l\xe1 b\xe0i n\xe0y, ch\xfang ta th\u1ea5y m\u1ed9t nh\xe2n v\u1eadt kh\xf3c k\xedn ng\u01b0\u1eddi trong b\u1ed9 \u0111\u1ed3 m\xe0u \u0111en v\xe0 ch\xecm ng\u1eadp trong \u0111au bu\u1ed3n. H\xecnh t\u01b0\u1ee3ng ng\u01b0\u1eddi \u0111\xe0n \xf4ng n\xe0y m\u1ea1nh \u0111\u1ebfn n\u1ed7i l\u1ea5n \xe1t c\xe1c chi ti\u1ebft kh\xe1c trong l\xe1 b\xe0i v\xe0 r\u1ea5t kh\xf3 \u0111\u1ec3 nh\xecn ra ph\xeda xa c\u1ee7a \xf4ng. 5 of Cups \u0111\u1ec1 c\u1eadp \u0111\u1ebfn th\u1eddi \u0111i\u1ec3m \u0111\xf3 khi n\u1ed7i \u0111au c\u1ee7a m\u1ed9t s\u1ef1 m\u1ea5t m\xe1t tr\u1edf n\xean \u0111au \u0111\u1edbn nh\u1ea5t. Ng\u01b0\u1eddi \u0111\xe0n \xf4ng n\xe0y ch\u1ec9 nh\xecn v\xe0o c\xe1c c\u1ed1c b\u1ecb l\u1eadt ng\u01b0\u1ee3c tr\u01b0\u1edbc m\u1eb7t \xf4ng. Hi\u1ec7n t\u1ea1i, \xf4ng kh\xf4ng th\u1ec3 nh\u1eadn th\u1ea5y r\u1eb1ng v\u1eabn c\xf2n hai chi\u1ebfc c\u1ed1c v\u1eabn c\xf2n \u0111\u1ee9ng. Sau n\xe0y khi t\xe2m h\u1ed3n \u0111\xe3 \u0111\u01b0\u1ee3c ch\u1eefa l\xe0nh thanh th\u1ea3n, \xf4ng s\u1ebd c\xf3 th\u1ec3 nh\xecn th\u1ea5y t\u1ea5t c\u1ea3 nh\u1eefng g\xec c\xf2n l\u1ea1i.",28,"C\xf3 m\u1ed9t s\u1ef1 th\u1eadt hi\u1ec3n nhi\xean r\u1eb1ng lu\xf4n c\xf3 b\u1ea1o l\u1ef1c, gi\u1eadn d\u1eef v\xe0 x\u1ea5u t\xednh x\u1ea5u n\u1ebft kh\u1eafp m\u1ecdi l\xfac m\u1ecdi n\u01a1i tr\xean th\u1ebf gi\u1edbi. Th\u1ebf gi\u1edbi ch\u1eafc ch\u1eafn kh\xf4ng thi\u1ebfu nh\u1eefng y\u1ebfu t\u1ed1 ti\xeau c\u1ef1c nh\u01b0 v\u1eady, nh\u01b0ng \u0111\u1ed3ng th\u1eddi v\u1eabn c\xf3 nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p v\xe0 s\u1ef1 quan t\xe2m. M\u1ed9t ng\u01b0\u1eddi m\u1eb9 \u0111\u01b0a th\u1ee9c u\u1ed1ng cho \u0111\u1ee9a con c\u1ee7a m\xecnh. M\u1ed9t ng\u01b0\u1eddi b\u1ea1n cho m\u01b0\u1ee3n chi\u1ebfc xe c\u1ee7a m\xecnh v\xe0o d\u1ecbp cu\u1ed1i tu\u1ea7n. M\u1ed9t ng\u01b0\u1eddi c\xf4ng nh\xe2n vi\xean l\xe0m thay cho m\u1ed9t \u0111\u1ed3ng nghi\u1ec7p b\u1ecb \u1ed1m b\u1ec7nh. Nh\u1eefng c\u1eed ch\u1ec9 tuy nh\u1ecf \u0111\u1ebfn m\u1ee9c h\u1ea7u nh\u01b0 kh\xf4ng ai \u0111\u1ec3 \xfd nh\u01b0ng l\u1ea1i r\u1ea5t quan tr\u1ecdng. 6 of Cups l\xe0 m\u1ed9t l\xe1 b\xe0i c\u1ee7a l\xf2ng t\u1ed1t v\xe0 nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p \u0111\u1ea7y \u0111\u01a1n gi\u1ea3n. L\xe1 b\xe0i khuy\u1ebfn kh\xedch b\u1ea1n s\u1ed1ng t\u1eed t\u1ebf, h\xe0o ph\xf3ng v\xe0 r\u1ed9ng l\u01b0\u1ee3ng.",29,"Nh\xecn quanh c\u0103n ph\xf2ng ngay l\xfac n\xe0y, nh\u1eadn th\u1ea5y \u0111\u1ed3 \u0111\u1ea1c v\u1eabn trong t\xecnh tr\u1ea1ng l\u1ed9n x\u1ed9n nh\u01b0 b\xecnh th\u01b0\u1eddng, khi \u0111\xf3 t\xf4i bi\u1ebft 7 of Cups mu\u1ed1n n\xf3i g\xec v\u1edbi t\xf4i, tuy kh\xf4ng th\u1eadt ch\u1eafc ch\u1eafn. L\xe1 b\xe0i mu\u1ed1n truy\u1ec1n t\u1ea3i th\xf4ng \u0111i\u1ec7p r\u1eb1ng, \u201cPh\u1ea3i r\u1ed3i, tr\u1eadt t\u1ef1 v\xe0 ch\u0103m ch\u1ec9 l\xe0 r\u1ea5t t\u1ed1t, nh\u01b0ng ch\u1eb3ng ph\u1ea3i s\u1ebd th\xfa v\u1ecb h\u01a1n n\u1ebfu ta bu\xf4ng b\u1ecf t\u1ea5t c\u1ea3 sao?\u201d Cho \u0111i t\u1ea5t c\u1ea3 l\xe0 nh\u1eefng g\xec 7 of Cups mu\u1ed1n n\xf3i \u0111\u1ebfn.",30,"M\u1ed9t s\u1ed1 thay \u0111\u1ed5i c\xf3 th\u1ec3 g\xe2y ra c\u1ea3m gi\xe1c ki\u1ec7t qu\u1ec7 hay m\u1ec7t m\u1ecfi. K\u1ebft th\xfac kh\xf4ng ph\u1ea3i lu\xf4n lu\xf4n l\xe0 \u0111i\u1ec1u d\u1ec5 d\xe0ng. M\u1ed9t trong nh\u1eefng d\u1ea5u hi\u1ec7u c\u1ee7a m\u1ed9t s\u1ef1 s\u1eb5n s\xe0ng r\u1eddi b\u1ecf l\xe0 thi\u1ebfu n\u0103ng l\u01b0\u1ee3ng. Khi b\u1ea1n c\u1ea3m th\u1ea5y m\u1ec7t m\u1ecfi v\xe0 ch\xe1n n\u1ea3n, b\u1ea1n bi\u1ebft r\u1eb1ng c\xf3 g\xec \u0111\xf3 kh\xf4ng \u1ed5n, v\xe0 \u0111\xf3 l\xe0 th\u1eddi \u0111i\u1ec3m cho m\u1ed9t h\u01b0\u1edbng \u0111i m\u1edbi. H\xe3y xem x\xe9t l\u1ea1i cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n v\xe0 nh\u1eefng \u01b0u ti\xean c\u1ee7a b\u1ea3n th\xe2n. B\u1ea1n s\u1ebd t\xecm th\u1ea5y m\xecnh c\u1ea7n ph\u1ea3i d\u1ea5n th\xe2n v\xe0o kh\xeda c\u1ea1nh n\xe0o trong cu\u1ed9c s\u1ed1ng.",31,"H\xecnh t\u01b0\u1ee3ng ng\u01b0\u1eddi \u0111\xe0n \xf4ng trong l\xe1 9 of Cups g\u1ee3i \u0111\u1ebfn h\xecnh \u1ea3nh m\u1ed9t ch\xfa m\xe8o \u0103n chim ho\xe0ng y\u1ebfn. Ng\xe0y nay, chim ho\xe0ng y\u1ebfn l\xe0 lo\xe0i v\u1eadt nu\xf4i c\u1ea7n ph\u1ea3i \u0111\u01b0\u1ee3c gi\u1eef c\xe1ch xa nh\u1eefng ch\xfa m\xe8o h\xe1u \u0103n. B\u1ea5t c\u1ee9 ch\xfa m\xe8o n\xe0o b\u1eaft \u0111\u01b0\u1ee3c chim \u0111\u1ec1u s\u1ebd c\u1ea3m th\u1ea5y kh\xe1 t\u1ef1 ph\u1ee5. \u0110\xf3 ch\xednh l\xe0 \xfd ngh\u0129a t\u1ed5ng th\u1ec3 c\u1ee7a 9 of Cups, s\u1ef1 \u0111am m\xea thu\u1ea7n t\xfay v\xe0 t\u1ef1 th\u1ecfa m\xe3n.",32,"Tr\xean l\xe1 Ten of Cups l\xe0 h\xecnh \u1ea3nh m\u1ed9t c\u1eb7p \u0111\xf4i v\u1ee3 ch\u1ed3ng c\xf9ng nh\u1eefng \u0111\u1ee9a con \u0111ang v\xf4 t\u01b0 n\xf4 \u0111\xf9a. Ng\xf4i nh\xe0 c\u1ee7a gia \u0111\xecnh n\xe0y n\u1eb1m ph\xeda xa bao quanh b\u1edfi h\xe0ng c\xe2y v\xe0 con su\u1ed1i nh\u1ecf. M\u1ed9t chi\u1ebfc c\u1ea7u v\u1ed3ng mang nh\u1eefng chi\u1ebfc c\u1ed1c ph\xeda tr\xean cao nh\u01b0 ch\xfac ph\xfac cho to\xe0n khung c\u1ea3nh. Nh\u1eefng ng\u01b0\u1eddi th\xedch ganh gh\xe9t so \u0111o c\xf3 th\u1ec3 s\u1ebd ch\u1ebf gi\u1ec5u khung c\u1ea3nh l\xe3ng m\u1ea1n \u0111\xf3, nh\u01b0ng th\u1ef1c t\u1ebf c\u1ea3nh tr\xed trong l\xe1 b\xe0i n\xe0y nh\u01b0 m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a \u0111\u1eddi s\u1ed1ng t\xecnh c\u1ea3m c\u1ee7a ch\xfang ta \u1edf m\u1ee9c \u0111\u1ed9 vi\xean m\xe3n nh\u1ea5t. Nh\u1eefng c\u1ea3m x\xfac xu\u1ea5t hi\u1ec7n trong b\u1ed1i c\u1ea3nh n\xe0y v\xf4 c\xf9ng l\xfd t\u01b0\u1edfng v\xe0 ho\xe0n to\xe0n n\u1eb1m trong t\u1ea7m tay c\u1ee7a m\u1ed7i ng\u01b0\u1eddi ch\xfang ta.",33,"L\xe1 b\xe0i Page of Cups l\xe0 th\u1ea7n Cupid mang \u0111\u1ebfn cho b\u1ea1n nh\u1eefng c\u01a1 h\u1ed9i v\u1ec1 t\xecnh y\xeau. Ch\xe0ng ta truy\u1ec1n t\u1ea3i nh\u1eefng c\u01a1 h\u1ed9i th\u1ef1c t\u1ebf \u0111\u1ec3 tr\u1ea3i nghi\u1ec7m s\u1ef1 l\xe3ng m\u1ea1n, nh\u1eefng c\u1ea3m gi\xe1c s\xe2u s\u1eafc v\xe0 cu\u1ed9c s\u1ed1ng n\u1ed9i t\xe2m, v\u1ed1n l\xe0 nh\u1eefng k\u1ef3 quan \u0111\u1eb7c tr\u01b0ng c\u1ee7a b\u1ed9 Cups. Trong c\xe1c l\u01b0\u1ee3t tr\u1ea3i b\xe0i Tarot, l\xe1 Page of Cups n\xe0y cho th\u1ea5y m\u1ed9t s\u1ef1 khai m\u1edf c\xf3 th\u1ec3 xu\u1ea5t hi\u1ec7n \u0111\u1ec3 khu\u1ea5y \u0111\u1ed9ng nh\u1eefng x\xfac c\u1ea3m c\u1ee7a b\u1ea1n, k\xe9o b\u1ea1n v\xe0o nh\u1eefng t\xecnh c\u1ea3m s\xe2u s\u1eafc nh\u1ea5t v\xe0 mang \u0111\u1ebfn b\u1ea1n ni\u1ec1m vui l\u1edbn lao. Khi b\u1ea1n th\u1ea5y m\u1ed9t c\u01a1 h\u1ed9i nh\u01b0 v\u1eady, h\xe3y ch\u1edbp l\u1ea5y ngay!",34,"Theo kh\xeda c\u1ea1nh t\xedch c\u1ef1c, Knight of Cups mang m\u1ed9t linh h\u1ed3n nh\u1ea1y c\u1ea3m. Anh ta l\xe0 m\u1ed9t nh\xe0 th\u01a1 \u2013 m\u1ed9t ng\u01b0\u1eddi t\xecnh c\u1ee7a m\u1ecdi th\u1ee9 l\xe3ng m\u1ea1n v\xe0 tinh t\u1ebf. Anh ta s\u1eed d\u1ee5ng tr\xed t\u01b0\u1edfng t\u01b0\u1ee3ng c\u1ee7a m\xecnh theo c\xe1ch k\u1ef3 di\u1ec7u v\xe0 x\xe2m nh\u1eadp v\xe0o m\u1ee9c \u0111\u1ed9 s\xe2u s\u1eafc nh\u1ea5t c\u1ee7a c\u1ea3m x\xfac. Anh ta bi\u1ebft c\xe1ch t\u1ea1o ra n\xe9t \u0111\u1eb9p v\xe0 chia s\u1ebb n\xf3 v\u1edbi ng\u01b0\u1eddi kh\xe1c. Theo kh\xeda c\u1ea1nh ti\xeau c\u1ef1c, l\xe1 Knight c\xf3 xu h\u01b0\u1edbng bay b\u1ed5ng v\xe0 m\u01a1 m\u1ed9ng. Tr\u1ea1ng th\xe1i c\u1ea3i l\u01b0\u01a1ng c\u1ee7a anh ta gi\u1ed1ng nh\u01b0 truy\u1ec7n c\u1ed5 t\xedch hay th\u1ea7n tho\u1ea1i, v\xe0 c\u1ea3m x\xfac c\u1ee7a anh ta th\u01b0\u1eddng l\u1ea5n \xe1t anh ta. Anh ta c\u0169ng th\u1ea5t th\u01b0\u1eddng v\xe0 d\u1ec5 l\xe0m m\u1ea5t l\xf2ng. Anh ta kh\xf4ng th\u1ec3 ch\u1ecbu n\u1ed5i s\u1ef1 kh\xf3 ch\u1ecbu v\xe0 s\u1ebd lu\xf4n \u0111\u1ec3 ng\u01b0\u1eddi kh\xe1c gi\u1ea3i quy\u1ebft gi\xf9m.",35,"L\xe1 Queen n\xe0y c\u0169ng c\xf3 th\u1ec3 \u0111\u1ea1i di\u1ec7n m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng ho\u1eb7c ph\u1ee5 n\u1eef, ho\u1eb7c m\u1ed9t b\u1ea7u kh\xf4ng kh\xed c\u1ee7a l\xf2ng y\xeau th\u01b0\u01a1ng d\u1ecbu d\xe0ng, bi\u1ebft ch\u1ea5p nh\u1eadn v\xe0 t\xf4n tr\u1ecdng c\u1ea3m x\xfac. Trong m\u1ed9t gi\u1ea3i b\xe0i, Queen of Cups cho b\u1ea1n bi\u1ebft r\u1eb1ng ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng \u0111\u1eb7c bi\u1ec7t c\u1ee7a n\xe0ng c\xf3 \xfd ngh\u0129a l\u1edbn lao d\xe0nh cho b\u1ea1n v\xe0o th\u1eddi \u0111i\u1ec3m n\xe0y. H\xe3y \u0111\u1ec3 b\u1ea3n th\xe2n b\u1ea1n \u0111\u01b0\u1ee3c truy\u1ec1n c\u1ea3m h\u1ee9ng b\u1edfi l\xe1 Queen n\xe0y d\u01b0\u1edbi b\u1ea5t k\u1ef3 h\xecnh th\u1ee9c xu\u1ea5t hi\u1ec7n n\xe0o trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n.",36,"Trong gi\u1ea3i b\xe0i tarot, King of Cups y\xeau c\u1ea7u b\u1ea1n c\xf3 nh\u1eefng h\xe0nh \u0111\u1ed9ng t\u1eed t\u1ebf nh\u01b0 \xf4ng \u1ea5y. V\xed d\u1ee5: h\xe0nh \u0111\u1ed9ng b\xecnh t\u0129nh trong kh\u1ee7ng ho\u1ea3ng, s\u1eed d\u1ee5ng s\u1ef1 kh\xf4n kh\xe9o thay v\xec v\u0169 l\u1ef1c, y\xeau c\u1ea7u s\u1ef1 gi\xfap \u0111\u1ee1, ho\u1eb7c ch\u1ea5p nh\u1eadn m\u1ed9t quan \u0111i\u1ec3m kh\xe1c. L\xe1 King n\xe0y c\xf3 th\u1ec3 \u0111\u1ea1i di\u1ec7n cho m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng ho\u1eb7c ph\u1ee5 n\u1eef c\xf3 nh\u1eefng h\xe0nh \u0111\u1ed9ng nh\u01b0 \xf4ng, ho\u1eb7c m\u1ed9t b\u1ea7u kh\xf4ng kh\xed quan t\xe2m chu \u0111\xe1o, khoan dung v\xe0 th\u1ea5u hi\u1ec3u. Trong m\u1ed9t gi\u1ea3i b\xe0i tarot, \xf4ng \u1ea5y cho b\u1ea1n bi\u1ebft r\u1eb1ng n\u0103ng l\u01b0\u1ee3ng \u0111\u1eb7c bi\u1ec7t c\u1ee7a \xf4ng s\u1ebd r\u1ea5t h\u1eefu \xedch v\u1edbi b\u1ea1n \u1edf th\u1eddi \u0111i\u1ec3m n\xe0y. H\xe3y \u0111\u1ec3 b\u1ea3n th\xe2n m\xecnh \u0111\u01b0\u1ee3c truy\u1ec1n c\u1ea3m h\u1ee9ng b\u1edfi King of Cups theo b\u1ea5t k\u1ef3 h\xecnh th\u1ee9c n\xe0o \xf4ng xu\u1ea5t hi\u1ec7n trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n.",37,"L\xe1 Ace of Pentacles l\xe0 bi\u1ec3u t\u01b0\u1ee3ng cho th\u1ea5y kh\u1ea3 n\u0103ng xu\u1ea5t hi\u1ec7n c\u1ee7a s\u1ef1 th\u1ecbnh v\u01b0\u1ee3ng, sung t\xfac, ni\u1ec1m tin, s\u1ef1 an to\xe0n, v\xe0 s\u1ef1 v\u1eefng ch\u1eafc. Trong gi\u1ea3i b\xe0i, l\xe1 b\xe0i n\xe0y cho th\u1ea5y \u201ch\u1ea1t gi\u1ed1ng c\u1ee7a n\u0103ng su\u1ea5t\u201d \u0111\xe3 \u0111\u01b0\u1ee3c gieo v\xe0o l\xf2ng b\u1ea1n cho d\xf9 b\u1ea1n ch\u01b0a nh\u1eadn ra \u0111\u01b0\u1ee3c. H\u1ea1t gi\u1ed1ng n\xe0y c\xf3 th\u1ec3 l\xe0 b\u1ea5t c\u1ee9 \u0111i\u1ec1u g\xec khi khai n\u1edf. \u0110\xf3 c\xf3 th\u1ec3 l\xe0 c\u1ea3m gi\xe1c \u0111\u01b0\u1ee3c tr\u1edf th\xe0nh t\xe2m \u0111i\u1ec3m, ni\u1ec1m ao \u01b0\u1edbc hay nhu c\u1ea7u mu\u1ed1n t\u1eadp trung v\xe0o c\xe1c v\u1ea5n \u0111\u1ec1 th\u1ef1c ti\u1ec5n. X\xe9t tr\xean kh\xeda c\u1ea1nh kh\xe1c, \u201ch\u1ea1t gi\u1ed1ng c\u1ee7a n\u0103ng su\u1ea5t\u201d n\xe0y c\xf3 th\u1ec3 l\xe0 m\u1ed9t m\xf3n qu\xe0, m\u1ed9t l\u1eddi \u0111\u1ec1 ngh\u1ecb, m\u1ed9t c\u01a1 h\u1ed9i, m\u1ed9t s\u1ef1 ki\u1ec7n g\u1eb7p g\u1ee1 hay k\u1ebft n\u1ed1i v\u1edbi ng\u01b0\u1eddi kh\xe1c.",38,"Kh\xf4ng c\xf3 c\u1ea3m gi\xe1c n\xe0o gi\u1ed1ng nh\u01b0 c\u1ea3m gi\xe1c v\u1eeba thanh nh\xe3 l\u1ea1i v\u1eeba hi\u1ec7u qu\u1ea3. L\xe1 Two of Pentacles c\xf3 h\xecnh \u1ea3nh m\u1ed9t ch\xe0ng trai tr\u1ebb nh\u1ea3y m\xfaa khi c\u1ed1 g\u1eafng c\xe2n b\u1eb1ng nh\u1eefng \xe2u lo c\u1ee7a th\u1ebf gian. H\xecnh \u1ea3nh d\u1ea5u v\xf4 c\u1ef1c quanh hai \u0111\u1ed3ng ti\u1ec1n cho th\u1ea5y r\u1eb1ng ch\xe0ng trai n\xe0y c\xf3 kh\u1ea3 n\u0103ng gi\u1ea3i quy\u1ebft v\xf4 s\u1ed1 c\xe1c v\u1ea5n \u0111\u1ec1 kh\xf3 kh\u0103n. \u1ede ph\xeda ph\xf4ng n\u1ec1n ch\xfang ta th\u1ea5y hai con t\xe0u \u0111ang d\u1ec5 d\xe0ng c\u01b0\u1ee1i tr\xean con s\xf3ng \u2013 t\u01b0\u1ee3ng tr\u01b0ng cho h\xecnh \u1ea3nh c\u01b0\u1ee1i l\xean nh\u1eefng n\u1ed1t th\u0103ng tr\u1ea7m c\u1ee7a cu\u1ed9c \u0111\u1eddi.",39,"Trong ph\u1ea7n \u0111\u1ea7u b\u1ed9 phim Mission Impossible, m\u1ed9t nh\xf3m chuy\xean vi\xean \u0111ang th\u1ef1c thi m\u1ed9t nhi\u1ec7m v\u1ee5 nguy hi\u1ec3m. C\xe1c th\xe0nh vi\xean trong \u0111\u1ed9i l\xean chi\u1ebfn thu\u1eadt, t\u1eadp h\u1ee3p c\xe1c ngu\u1ed3n l\u1ef1c v\xe0 s\u1eed d\u1ee5ng k\u1ef9 n\u0103ng c\u0169ng nh\u01b0 tr\xecnh \u0111\u1ed9 c\u1ee7a c\xe1c th\xe0nh vi\xean \u0111\u1ec3 ho\xe0n th\xe0nh nhi\u1ec7m v\u1ee5. \u0110\xf3 ch\xednh l\xe0 tinh th\u1ea7n c\u1ee7a l\xe1 3 of Pentacles: l\xe0m vi\u1ec7c nh\xf3m, l\u1eadp k\u1ebf ho\u1ea1ch v\xe0 ho\xe0n th\xe0nh m\u1ee5c ti\xeau.",40,"L\xfac n\xe0o \u0111\xf3 h\xe3y th\u1eed d\xe0nh th\u1eddi gian ch\u01a1i v\u1edbi m\u1ed9t \u0111\u1ee9a tr\u1ebb 2 tu\u1ed5i, b\u1ea1n s\u1ebd nhanh ch\xf3ng nghe \u0111\u01b0\u1ee3c nh\u1eefng th\xf4ng \u0111i\u1ec7p c\u1ee7a 4 of Pentacles nh\u01b0 \u201cKh\xf4ng!\u201d hay \u201cC\u1ee7a t\xf4i!\u201d \u0110\xf3 l\xe0 l\u1eddi g\xe0o th\xe9t t\u1eeb b\u1ea3n ng\xe3 v\u1ed1n \u0111\u01b0\u1ee3c ph\xe1t tri\u1ec3n trong th\u1eddi th\u01a1 \u1ea5u. B\u1ea3n ng\xe3 mu\u1ed1n \u0111\u1ea3m b\u1ea3o quy\u1ec1n l\u1ef1c c\u1ee7a m\xecnh th\xf4ng qua vi\u1ec7c \xe1p \u0111\u1eb7t \xfd nguy\u1ec7n c\u1ee7a m\xecnh. Mong mu\u1ed1n gi\u1eef quy\u1ec1n ki\u1ec3m so\xe1t l\xe0 d\u1ea5u \u1ea5n c\u1ee7a 4 of Pentacles.",41,"Hai nh\xe2n v\u1eadt tr\xean l\xe1 b\xe0i 5 of Pentacles l\xe0 hai con ng\u01b0\u1eddi l\u1ea7m l\u0169i gi\u1eefa \u0111\xeam \u0111\xf4ng l\u1ea1nh l\u1ebdo, \u0111\xf3i kh\xe1t, m\u1ecfi m\u1ec7t, b\u1ec7nh t\u1eadt v\xe0 ngh\xe8o kh\u1ed5. Nh\u1eefng g\xec h\u1ecd \u0111ang tr\u1ea3i qua khi\u1ebfn ta c\xf3 c\u1ea3m gi\xe1c nh\u01b0 nh\u1eefng nhu c\u1ea7u t\u1ed1i thi\u1ec3u nh\u1ea5t c\u1ee7a cu\u1ed9c s\u1ed1ng th\u1eadm ch\xed c\xf2n kh\xf4ng \u0111\u01b0\u1ee3c \u0111\xe1p \u1ee9ng. Nh\u1eefng ai trong ch\xfang ta v\u1ed1n c\xf3 cu\u1ed9c s\u1ed1ng sung t\xfac v\xe0 may m\u1eafn c\xf3 th\u1ec3 ch\u01b0a t\u1eebng tr\u1ea3i qua giai \u0111o\u1ea1n gi\u1ed1ng nhu v\u1eady, nh\u01b0ng ch\u1ee9ng ta v\u1eabn c\u1ea3m gi\xe1c r\xf5 s\u1ef1 th\u1ed1ng kh\u1ed5. R\xf5 r\xe0ng, khi nh\u1eefng g\xec ch\xfang ta mu\u1ed1n v\xe0 c\u1ea7n kh\xf4ng \u0111\u01b0\u1ee3c \u0111\xe1p \u1ee9ng, \u0111i\u1ec1u \u0111\xf3 kh\xf4ng kh\xe1c g\xec n\u1ed7i \u0111au.",42,"H\xecnh \u1ea3nh tr\xean l\xe1 b\xe0i m\xf4 t\u1ea3 m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng c\xf3 v\u1ebb nh\u01b0 r\u1ea5t gi\xe0u c\xf3 \u0111ang trao m\u1ed9t v\xe0i \u0111\u1ed3ng xu l\u1ebb cho ng\u01b0\u1eddi \u0103n m\xe0y b\xean tr\xe1i, trong khi c\xf9ng l\xfac m\u1ed9t k\u1ebb kh\xe1c b\xean ph\u1ea3i \u0111ang n\xe0i van \u0111\u1ee3i nh\u1eadn \u0111\u01b0\u1ee3c ph\u1ea7n c\u1ee7a m\xecnh. Ng\u01b0\u1eddi \u0111\xe0n \xf4ng cho ti\u1ec1n m\u1ed9t tay c\u1ea7m chi\u1ebfc c\xe2n c\xf4ng l\xfd nh\u01b0 th\u1ec3 \u0111\u1ec3 nh\u1ea5n m\u1ea1nh quy\u1ec1n quy\u1ebft \u0111\u1ecbnh xem ai l\xe0 ng\u01b0\u1eddi \u0111\xe1ng \u0111\u01b0\u1ee3c nh\u1eadn l\u1ea5y \xe2n hu\u1ec7 v\xe0 ai kh\xf4ng. H\xecnh \u1ea3nh tr\xean l\xe1 b\xe0i n\xe0y m\xf4 t\u1ea3 cho c\u1ea3 hai tr\u01b0\u1eddng h\u1ee3p: cho \u0111i v\xe0 nh\u1eadn \u0111\u01b0\u1ee3c, th\u1ed1ng tr\u1ecb v\xe0 quy ph\u1ee5c, \u0111\xfang tr\xean \u0111\u1ec9nh cao v\xe0 ch\u01a1i v\u01a1i d\u01b0\u1edbi \u0111\xe1y. Ai c\xf3 v\xe0 ai kh\xf4ng c\u0169ng r\u1ea5t r\xf5 r\xe0ng. Cu\u1ed9c s\u1ed1ng kh\xf4ng h\u1ec1 \u0111\u01a1n gi\u1ea3n, v\xe0 s\u1ef1 may m\u1eafn c\xf3 th\u1ec3 thay \u0111\u1ed5i r\u1ea5t nhanh.",43,"H\xecnh \u1ea3nh tr\xean l\xe1 b\xe0i 7 of Pentacles m\xf4 t\u1ea3 m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng v\u1eeba lao \u0111\u1ed9ng ch\u0103m ch\u1ec9 trong m\u1ed9t th\u1eddi gian d\xe0i \u0111ang \u0111\u1ee9ng trong khu v\u01b0\u1eddn c\u1ee7a m\xecnh. C\xe2y c\u1ed1i \u0111\xe3 \u0111\u01b0\u1ee3c gom l\u1ea1i th\xe0nh m\u1ed9t \u0111\u1ed1ng cao, v\xe0 tr\xean c\xe1c c\xe0nh tr\xe1i qu\u1ea3 \u0111ang ch\xedn tr\u1ed5. C\xf3 v\u1ebb nh\u01b0 anh ta \u0111\xe3 nh\u1eadn \u0111\u01b0\u1ee3c th\xe0nh qu\u1ea3 cho nh\u1eefng g\xec m\xecnh \u0111\xe3 l\xe0m. Anh \u0111ang ngh\u1ec9 ng\u01a1i \u0111\xf4i ch\xfat v\xe0 t\u1ef1 h\xe0o v\u1ec1 nh\u1eefng g\xec m\xecnh \u0111\xe3 l\xe0m \u0111\u01b0\u1ee3c. Ch\u1ee9ng ki\u1ebfn nh\u1eefng th\xe0nh qu\u1ea3 do hai b\xe0n tay m\xecnh l\xe0m n\xean l\xe0 m\u1ed9t c\u1ea3m gi\xe1c v\xf4 c\xf9ng tho\u1ea3i m\xe1i. Th\xe0nh c\xf4ng lu\xf4n lu\xf4n ng\u1ecdt ng\xe0o!",44,"Tr\xean l\xe1 b\xe0i 8 of Pentacles ch\xfang ta th\u1ea5y m\u1ed9t ch\xe0ng trai \u0111ang \u0111\u1ee5c kh\u1eafc m\u1ed9t \u0111\u1ed3ng ti\u1ec1n. Anh ta \u0111\xe3 ho\xe0n th\xe0nh \u0111\u01b0\u1ee3c s\xe1u \u0111\u1ed3ng v\xe0 c\xf3 m\u1ed9t \u0111\u1ed3ng n\u1eefa \u0111ang s\u1eafp ho\xe0n th\xe0nh. R\xf5 r\xe0ng l\xe0 anh ta \u0111ang l\xe0m m\u1ed9t c\xf4ng vi\u1ec7c thu h\xfat m\u1ecdi s\u1ef1 ch\xfa t\xe2m c\u1ee7a anh. Anh ta c\xf4 l\u1eadp ch\xednh m\xecnh kh\u1ecfi nh\u1eefng ng\u01b0\u1eddi kh\xe1c (t\xf2a th\xe1p \u1edf ph\xeda xa xa) \u0111\u1ec3 t\u1eadp trung v\xe0o d\u1ef1 \xe1n c\xf4ng vi\u1ec7c c\u1ee7a m\xecnh. Ch\xfang ta th\u1ea5y \u0111\u01b0\u1ee3c t\u1eeb h\xecnh \u1ea3nh n\xe0y nh\u1eefng y\u1ebfu t\u1ed1 \u0111\u1eb7c tr\u01b0ng c\u1ee7a 8 of Pentacles: l\xe0m vi\u1ec7c ch\u0103m ch\u1ec9 v\xe0 ch\xfa t\xe2m v\xe0o chi ti\u1ebft.",45,"Ng\u01b0\u1eddi ph\u1ee5 n\u1eef tr\xean l\xe1 b\xe0i Nine of Pentacles \u0111ang t\u1ea3n b\u1ed9 m\u1ed9t c\xe1ch th\u01b0 th\xe1i quanh khu v\u01b0\u1eddn c\u1ee7a c\xf4. Ng\u01b0\u1eddi ph\u1ee5 n\u1eefa n\xe0y r\xf5 r\xe0ng l\xe0 m\u1ed9t qu\xfd b\xe0 c\xf3 c\u1ed1t c\xe1ch \u0111\u1ea7y tao nh\xe3 v\xe0 l\u1ecbch thi\u1ec7p, v\xec th\u1ebf vi\u1ec7c tr\xean tay tr\xe1i c\xf4 c\xf3 m\u1ed9t con chim \u0111\u01b0\u1ee3c hu\u1ea5n luy\u1ec7n \u0111\u1ec3 s\u0103n b\u1eaft v\xe0 gi\u1ebft ch\xf3c theo m\u1ec7nh l\u1ec7nh l\xe0 m\u1ed9t chi ti\u1ebft kh\xf4ng m\u1ea5y ph\xf9 h\u1ee3p. Nu\xf4i chim s\u0103n m\u1ed3i kh\xf4ng ph\u1ea3i l\xe0 m\u1ed9t s\u1edf th\xedch b\xecnh th\u01b0\u1eddng \u0111\u1ed1i v\u1edbi m\u1ed9t qu\xfd b\xe0 quy\u1ec1n qu\xfd, nh\u01b0ng \u0111\xe2y l\xe0 ch\xednh l\xe0 ch\xeca kh\xf3a m\xf4 t\u1ea3 b\u1ea3n ch\u1ea5t \u0111\u1eb7c bi\u1ec7t c\u1ee7a l\xe1 b\xe0i n\xe0y.",46,"L\xe1 b\xe0i Ten of Pentacles \u0111\u1ea1i di\u1ec7n cho \u0111\xedch \u0111\u1ebfn cu\u1ed1i c\xf9ng c\u1ee7a th\xe0nh c\xf4ng v\u1eadt ch\u1ea5t. L\xe1 b\xe0i n\xe0y g\u1ee3i nh\u1edb \u0111\u1ebfn c\u1ea3m gi\xe1c h\xe0o nho\xe1ng c\u1ee7a s\u1ef1 gi\xe0u c\xf3 hay xu\u1ea5t hi\u1ec7n quanh nh\u1eefng ng\u01b0\u1eddi l\xe0m kinh doanh gi\u1ecfi. \u0110\xe2y ch\xednh l\xe0 l\xe1 b\xe0i m\xe0 b\u1ea5t k\u1ef3 ai c\u0169ng mu\u1ed1n th\u1ea5y nh\u1ea5t l\xe0 khi x\xe9t trong b\u1ed1i c\u1ea3nh lo l\u1eafng kh\xf4ng bi\u1ebft c\xf4ng vi\u1ec7c kinh doanh c\u1ee7a m\xecnh c\xf3 thu\u1eadn l\u1ee3i hay kh\xf4ng. Khi l\xe1 b\xe0i n\xe0y xu\u1ea5t hi\u1ec7n, t\u1ea5t c\u1ea3 s\u1ef1 gi\xe0u c\xf3 v\xe0 \u0111\u1ee7 \u0111\u1ea7y l\xe0 d\xe0nh cho b\u1ea1n.",47,"Page of Pentacles l\xe0 ng\u01b0\u1eddi mang l\u1ea1i cho b\u1ea1n th\xf4ng \u0111i\u1ec7p v\u1ec1 nh\u1eefng c\u01a1 h\u1ed9i v\u1eadt ch\u1ea5t. Anh ta chuy\u1ec3n nh\u1eefng c\u01a1 h\u1ed9i th\u1ef1c t\u1ebf th\xe0nh c\u1ee7a c\u1ea3i v\u1eadt ch\u1ea5t, s\u1ef1 h\u01b0ng th\u1ecbnh, s\u1ef1 \u0111\u1ea3m b\u1ea3o an to\xe0n v\xe0 nh\u1eefng th\xe0nh qu\u1ea3 v\u1eefng ch\u1eafc, v\u1ed1n l\xe0 nh\u1eefng ph\u1ea9m ch\u1ea5t tuy\u1ec7t v\u1eddi c\u1ee7a b\u1ed9 Pentacles. Trong gi\u1ea3i b\xe0i Tarot, l\xe1 Page of Pentacles h\xe0m ngh\u0129a \u0111\u1ebfn m\u1ed9t s\u1ef1 kh\u1edfi \u0111\u1ea7u m\u1edbi h\u1ee9a h\u1eb9n gi\xe0u sang, sung t\xfac, ph\u1ed3n vinh, tr\xe0n \u0111\u1ea7y ni\u1ec1m tin t\u01b0\u1edfng ho\u1eb7c c\u01a1 h\u1ed9i \u0111\u1ec3 bi\u1ebfn gi\u1ea5c m\u01a1 th\xe0nh s\u1ef1 th\u1eadt. Khi b\u1ea1n th\u1ea5y m\u1ed9t c\u01a1 h\u1ed9i nh\u01b0 v\u1eady, h\xe3y n\u1eafm b\u1eaft ngay.",48,"N\u1ebfu \xfd ngh\u0129a c\u1ee7a l\xe1 b\xe0i n\xe0y \u1ee9ng nghi\u1ec7m v\u1edbi t\xecnh tr\u1ea1ng hi\u1ec7n t\u1ea1i c\u1ee7a b\u1ea1n, th\xec s\u1ef1 c\xe2n b\u1eb1ng l\xe0 \u0111i\u1ec1u c\u1ea7n thi\u1ebft. H\xe3y xem li\u1ec7u b\u1ea1n c\xf3 \u0111ang l\xe0m vi\u1ec7c qu\xe1 n\u1eb7ng nh\u1ecdc kh\xf4ng? Li\u1ec7u b\u1ea1n c\xf3 \u0111ang t\u1eeb ch\u1ed1i l\u1eafng nghe l\xfd do kh\xf4ng? Li\u1ec7u quan \u0111i\u1ec3m c\u1ee7a b\u1ea1n c\xf3 thi\xean v\u1ec1 ch\u1ee7 ngh\u0129a ho\xe0n h\u1ea3o kh\xf4ng? B\u1ea7u kh\xf4ng kh\xed xung quanh b\u1ea1n c\xf3 qu\xe1 \u1ea3m \u0111\u1ea1m hay tuy\u1ec7t v\u1ecdng kh\xf4ng? N\u1ebfu c\xf3, th\xec \u0111\xe2y c\xf3 th\u1ec3 l\xe0 th\u1eddi \u0111i\u1ec3m \u0111\u1ec3 thay \u0111\u1ed5i.",49,"Trong gi\u1ea3i b\xe0i tarot, Queen of Pentacle mu\u1ed1n b\u1ea1n suy ngh\u0129 v\xe0 c\u1ea3m nh\u1eadn nh\u01b0 n\xe0ng. V\xed d\u1ee5: B\u1ea1n c\xf3 c\u1ea3m th\u1ea5y m\xecnh c\xf3 t\u1ea5m l\xf2ng \u1ea5m \xe1p v\xe0 lu\xf4n quan t\xe2m \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi kh\xe1c kh\xf4ng? B\u1ea1n c\xf3 s\u1ed1ng v\xe0 l\xe0m vi\u1ec7c m\u1ed9t c\xe1ch th\u1ef1c t\u1ebf kh\xf4ng? B\u1ea1n c\xf3 n\xf3i th\u1eadt l\xf2ng kh\xf4ng? B\u1ea1n c\xf3 c\u1ea3m th\u1ea5y m\xecnh r\u1ed9ng l\u01b0\u1ee3ng kh\xf4ng? Ng\u01b0\u1eddi kh\xe1c c\xf3 th\u1ec3 tin t\u01b0\u1edfng b\u1ea1n khi l\xe2m v\xe0o ho\xe0n c\u1ea3nh kh\xf3 kh\u0103n kh\xf4ng?",50,"Trong gi\u1ea3i b\xe0i tarot, King of Pentacles l\xe0 l\u1eddi k\xeau g\u1ecdi b\u1ea1n h\xe0nh \u0111\u1ed9ng theo nh\u1eefng ph\u1ea9m ch\u1ea5t c\u1ee7a v\u1ecb vua n\xe0y. V\xed d\u1ee5: lu\xf4n gi\u1eef \u0111\xfang cam k\u1ebft, kh\u1eafc ph\u1ee5c nh\u1eefng r\u1ea1n v\u1ee1, t\u1ea1o ra ti\u1ec1n b\u1ea1c c\u1ee7a c\u1ea3i, ho\u1eb7c t\xe0i tr\u1ee3 m\u1ed9t cho m\u1ed9t d\u1ef1 \xe1n kinh doanh m\u1edbi. L\xe1 b\xe0i n\xe0y c\u0169ng c\xf3 th\u1ec3 \u0111\u1ea1i di\u1ec7n cho m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng ho\u1eb7c ph\u1ee5 n\u1eef c\xf3 nh\u1eefng ph\u1ea9m ch\u1ea5t gi\u1ed1ng nh\u01b0 \xf4ng, ho\u1eb7c g\u1ee3i \u0111\u1ebfn m\u1ed9t b\u1ea7u kh\xf4ng kh\xed \u1ed5n \u0111\u1ecbnh v\xe0 \u0111\xe1ng tin c\u1eady. Trong m\u1ed9t l\u01b0\u1ee3t gi\u1ea3i b\xe0i, King of Pentacles cho b\u1ea1n bi\u1ebft r\u1eb1ng ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng \u0111\u1eb7c bi\u1ec7t c\u1ee7a \xf4ng s\u1ebd c\xf3 nhi\u1ec1u \xfd ngh\u0129a v\u1edbi b\u1ea1n \u1edf th\u1eddi \u0111i\u1ec3m n\xe0y. H\xe3y \u0111\u1ec3 cho b\u1ea3n th\xe2n m\xecnh \u0111\u01b0\u1ee3c truy\u1ec1n c\u1ea3m h\u1ee9ng b\u1edfi King of Pentacles d\u01b0\u1edbi b\u1ea5t k\u1ef3 h\xecnh th\u1ee9c n\xe0o khi \xf4ng \u1ea5y xu\u1ea5t hi\u1ec7n trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n.",51,"Ace of Swords l\xe0 m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a kh\u1ea3 n\u0103ng trong l\u0129nh v\u1ef1c tr\xed tu\u1ec7, lu\u1eadn ch\u1ee9ng, c\xf4ng l\xfd, s\u1ef1 th\u1eadt, s\u1ef1 r\xf5 r\xe0ng v\xe0 l\xf2ng d\u0169ng c\u1ea3m. Trong phi\xean gi\u1ea3i b\xe0i Tarot, Ace of Swords l\xe0 d\u1ea5u ch\u1ec9 cho th\u1ea5y r\u1eb1ng h\u1ea1t gi\u1ed1ng c\u1ee7a s\u1ef1 hi\u1ec3u bi\u1ebft r\xf5 r\xe0ng \u0111\xe3 \u0111\u01b0\u1ee3c gieo tr\u1ed3ng trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n m\u1eb7c d\xf9 b\u1ea1n c\xf3 th\u1ec3 ch\u01b0a nh\u1eadn ra n\xf3. Khi h\u1ea1t gi\u1ed1ng n\u1ea3y m\u1ea7m, n\xf3 c\xf3 th\u1ec3 xu\u1ea5t hi\u1ec7n  g\u1ea7n nh\u01b0 d\u01b0\u1edbi m\u1ecdi h\xecnh th\u1ee9c. N\xf3 c\xf3 th\u1ec3 l\xe0 m\u1ed9t \xfd t\u01b0\u1edfng h\u1ea5p d\u1eabn, mong mu\u1ed1n v\u1ec1 s\u1ef1 th\u1eadt, l\u1eddi k\xeau g\u1ecdi c\xf4ng l\xfd, ho\u1eb7c nhu c\u1ea7u c\u1ea7n s\u1ef1 trung th\u1ef1c. \u1ede kh\xeda c\u1ea1nh b\xean ngo\xe0i, n\xf3 c\xf3 th\u1ec3 l\xe0 m\u1ed9t l\u1eddi \u0111\u1ec1 ngh\u1ecb, m\u1ed9t m\xf3n qu\xe0 t\u1eb7ng, c\u01a1 h\u1ed9i, cu\u1ed9c g\u1eb7p g\u1ee1 ho\u1eb7c m\u1ed9t s\u1ef1 ki\u1ec7n nhi\u1ec1u y\u1ebfu t\u1ed1 x\u1ea3y ra \u0111\u1ed3ng th\u1eddi.",52,"2 of Swords n\xf3i v\u1ec1 nh\u1eefng r\xe0o c\u1ea3n m\xe0 ch\xfang ta t\u1ef1 \u0111\u01b0a ra, ng\u0103n c\xe1ch gi\u1eefa ch\xfang ta v\xe0 nh\u1eefng ng\u01b0\u1eddi kh\xe1c v\xe0 nh\u1eefng r\xe0o c\u1ea3n m\xe0 ta t\u1ea1o ra t\u1eeb ch\xednh trong n\u1ed9i t\xe2m m\xecnh. Trong th\xe2m t\xe2m, ch\xfang ta ch\u1eb7n \u0111\u1ee9ng c\xe1c d\xf2ng c\u1ea3m x\xfac v\xe0 t\u1eeb ch\u1ed1i c\u1ea3m nh\u1eadn ch\xfang. Ch\xfang ta tr\xe1nh nh\xecn v\xe0o s\u1ef1 th\u1eadt v\xe0 gi\u1ea3 v\u1edd r\u1eb1ng t\u1ea5t c\u1ea3 m\u1ecdi th\u1ee9 \u0111\u1ec1u \u1ed5n. Ch\xfang ta ngh\u0129 th\u1ebf n\xe0y, nh\u01b0ng l\u1ea1i c\u1ea3m nh\u1eadn th\u1ebf kh\xe1c. Ch\xfang ta c\u1ed1 g\u1eafng duy tr\xec t\xecnh tr\u1ea1ng hi\u1ec7n t\u1ea1i b\u1eb1ng m\u1ecdi gi\xe1 d\u1eabu bi\u1ebft r\u1eb1ng l\u1ebd ra ta c\u1ea7n ph\u1ea3i ch\u1ea5p nh\u1eadn v\xe0 \u0111\u1ed1i m\u1eb7t v\u1edbi th\u1ef1c t\u1ebf.",53,"H\xecnh \u1ea3nh tr\xean 3 of Swords m\xf4 t\u1ea3 m\u1ed9t n\u1ed7i \u0111au \u0111\u1ed9t ng\u1ed9t. B\u1ea1n c\u1ea3m th\u1ea5y nh\u01b0 m\u1ed9t ai \u0111\xf3 \u0111\xe2m thanh ki\u1ebfm s\u1eafc b\xe9n xuy\xean qua tim b\u1ea1n. M\u1ed9t chi ti\u1ebft nh\u1ecf nh\u1eb7t ch\u1eb3ng h\u1ea1n nh\u01b0 m\u1ed9t l\u1eddi ph\xea b\xecnh hay ph\xea b\xecnh cay nghi\u1ec7t c\u0169ng khi\u1ebfn b\u1ea1n c\u1ea3m th\u1ea5y \u0111au \u0111\u1edbn nhu v\u1eady. H\xe3y ch\xfa \xfd r\u1eb1ng h\xecnh \u1ea3nh \u1edf \u0111\xe2y ch\u1ec9 \u0111\u01a1n gi\u1ea3n l\xe0 m\u1ed9t tr\xe1i tim v\xe0 ba thanh ki\u1ebfm. Khi tr\xe1i tim tan v\u1ee1, b\u1ea1n s\u1ebd kh\xf4ng c\xf2n c\u1ea3m th\u1ea5y g\xec ngo\xe0i n\u1ed7i \u0111au c\u1ee7a m\u1ed9t v\u1ebft th\u01b0\u01a1ng h\u1edf trong tim.",54,"Trong gi\u1ea3i b\xe0i Tarot, 4 of Swords th\u01b0\u1eddng l\xe0 m\u1ed9t d\u1ea5u hi\u1ec7u cho th\u1ea5y b\u1ea1n c\u1ea7n ph\u1ea3i s\u1ed1ng v\xe0 h\xe0nh \u0111\u1ed9ng ch\u1eadm l\u1ea1i v\xe0 d\xe0nh th\u1eddi gian ngh\u1ec9 ng\u01a1i. N\u1ebfu b\u1ea1n \u0111ang h\u1ed3i ph\u1ee5c sau m\u1ed9t c\u0103n b\u1ec7nh, h\xe3y cho ph\xe9p b\u1ea3n th\xe2n c\xf3 th\u1eddi gian ngh\u1ec9 ng\u01a1i \u0111\u1ec3 ph\u1ee5c h\u1ed3i. Ngay c\u1ea3 khi b\u1ea1n c\u1ea3m th\u1ea5y ho\xe0n to\xe0n kh\u1ecfe m\u1ea1nh, b\u1ea1n v\u1eabn c\xf3 th\u1ec3 s\u1ebd b\u1ecb b\u1ec7nh n\u1ebfu b\u1ea1n kh\xf4ng ngh\u1ec9 ng\u01a1i.",55,"Trong gi\u1ea3i b\xe0i tarot, l\xe1 b\xe0i 5 of Swords c\xf3 th\u1ec3 h\xe0m \xfd r\u1eb1ng b\u1ea1n ho\u1eb7c ai \u0111\xf3 kh\xe1c \u0111ang b\u1ecf qua m\u1ed9t quan \u0111i\u1ec3m, m\u1ed9t s\u1ef1 nh\xecn nh\u1eadn l\u1edbn h\u01a1n v\u1ec1 c\xe1i t\xf4i \u2013 b\u1ea3n th\xe2n. B\u1ea1n \u0111ang x\xe1c \u0111\u1ecbnh c\xe1c m\u1ed1i quan t\xe2m c\u1ee7a m\xecnh qu\xe1 h\u1ea1n h\u1eb9p. N\u1ebfu b\u1ea1n c\u1ee9 m\xe3i c\u1ed1 g\u1eafng x\xfac ti\u1ebfn m\u1ecdi th\u1ee9 m\u1ed9t m\xecnh, c\xe1c h\xe0nh \u0111\u1ed9ng c\u1ee7a b\u1ea1n s\u1ebd quay ng\u01b0\u1ee3c tr\u1edf l\u1ea1i \xe1m \u1ea3nh b\u1ea1n sau \u0111\xf3, b\u1eb1ng c\xe1ch n\xe0y hay c\xe1ch kh\xe1c.",56,"Tr\xean th\u1ef1c t\u1ebf, l\xe1 b\xe0i 6 of Swords c\xf3 th\u1ec3 h\xe0m \xfd m\u1ed9t chuy\u1ebfn du l\u1ecbch ho\u1eb7c di chuy\u1ec3n theo m\u1ecdi ngh\u0129a. L\xe1 b\xe0i c\u0169ng c\xf3 th\u1ec3 h\xe0m ngh\u0129a m\u1ed9t s\u1ef1 thay \u0111\u1ed5i th\u1ef1c s\u1ef1 v\u1ec1 ho\xe0n c\u1ea3nh, \u0111\u1ed5i v\u1ecb tr\xed ho\u1eb7c m\u1ed9t chuy\u1ebfn \u0111i. M\u1ed9t cu\u1ed9c h\xe0nh tr\xecnh c\u0169ng c\xf3 th\u1ec3 di\u1ec5n ra \u1edf b\xean trong b\u1ea1n khi ch\xfang ta chuy\u1ec3n t\u1eeb m\u1ed9t khung suy ngh\u0129 c\u0169 sang quan \u0111i\u1ec3m m\u1edbi.",57,"L\xe1 b\xe0i n\xe0y \u0111\xf4i khi \u0111\u1ea1i di\u1ec7n cho phong c\xe1ch \u201cs\xf3i \u0111\u01a1n \u0111\u1ed9c\u201d \u2013 mong mu\u1ed1n bay nh\u1ea3y t\u1ef1 do m\u1ed9t m\xecnh. Trong phim, ng\u01b0\u1eddi anh h\xf9ng \u0111\u01a1n \u0111\u1ed9c lu\xf4n h\xe0nh \u0111\u1ed9ng ho\xe0n to\xe0n b\u1eb1ng s\u1ee9c m\xecnh. Anh ta kh\xe1m ph\xe1, t\xecm t\xf2i v\xe0 gi\u1ea3i quy\u1ebft m\u1ecdi v\u1ea5n \u0111\u1ec1 b\u1eb1ng ch\xednh s\u1ef1 th\xf4ng minh v\xe0 ngu\u1ed3n l\u1ef1c c\u1ee7a ri\xeang b\u1ea3n th\xe2n m\xecnh. Anh ta tin r\u1eb1ng m\xecnh s\u1ebd th\xe0nh c\xf4ng v\xec anh ta ph\u1edbt l\u1edd nh\u1eefng n\u1ed7 l\u1ef1c v\u1ee5ng v\u1ec1 c\u1ee7a nh\u1eefng ng\u01b0\u1eddi t\u1ea7m th\u01b0\u1eddng kh\xe1c.",58,"Ng\u01b0\u1eddi ph\u1ee5 n\u1eef trong l\xe1 b\xe0i 8 of Swords \u0111ang m\u1ea5t ph\u01b0\u01a1ng h\u01b0\u1edbng v\xe0 \u0111\u01a1n \u0111\u1ed9c. C\xf4 ta kh\xf4ng th\u1ec3 th\u1ea5y \u0111\u01b0\u1eddng do \u0111\xe3 b\u1ecb b\u1ecbt m\u1eaft. C\xf4 kh\xf4ng th\u1ec3 k\xeau g\u1ecdi s\u1ef1 gi\xfap \u0111\u1ee1 do c\xf4 \u0111ang b\u1ecb tr\xf3i bu\u1ed9c. C\xf4 kh\xf4ng th\u1ec3 t\u1ef1 do di chuy\u1ec3n v\xec c\xf4 \u0111ang b\u1ecb c\u1ea7m gi\u1eef b\u1edfi c\xe1c thanh ki\u1ebfm xung quanh. D\u01b0\u1eddng nh\u01b0 c\xf4 \u0111\xe3 lang thang \u0111\u1ebfn m\u1ed9t n\xf4i c\xe1ch xa nh\xe0 \u2013 n\u01a1i trao cho c\xf4 s\u1ef1 an to\xe0n ph\xeda ng\u1ecdn \u0111\u1ed3i xa xa. L\xe0m c\xe1ch n\xe0o \u0111\u1ec3 c\xf4 c\xf3 th\u1ec3 tr\u1edf v\u1ec1? C\xf4 th\u1eadm ch\xed c\xf2n kh\xf4ng bi\u1ebft l\u1ed1i \u0111i. L\xe1 b\xe0i 8 of Swords \u0111\u1ea1i di\u1ec7n cho nh\u1eefng l\u1ee9c ch\xfang ta c\u1ea3m th\u1ea5y l\u1ea1c l\u1ed1i, l\u1eabn l\u1ed9n v\xe0 m\u1ea5t \u0111i kh\u1ea3 n\u0103ng c\u1ee7a m\xecnh. M\u1ecdi s\u1ef1 gi\xfap \u0111\u1ee1 v\xe0 ni\u1ec1m tin d\u01b0\u1eddng nh\u01b0 \u0111\xe3 bi\u1ebfn m\u1ea5t.",59,"H\xecnh t\u01b0\u1ee3ng nh\xe2n v\u1eadt trong l\xe1 b\xe0i 9 of Swords t\u1ec9nh d\u1eady tr\xean gi\u01b0\u1eddng g\u1ee3i nhi\u1ec1u \xfd ngh\u0129a v\xec n\u1eeda \u0111\xeam l\xe0 th\u1eddi \u0111i\u1ec3m nh\u1eefng n\u1ed7i \u0111au bu\u1ed3n v\xe0 h\u1ed1i ti\u1ebfc c\u1ee7a ch\xfang ta tr\xe0n \u0111\u1ebfn m\u1ed9t c\xe1ch m\u1ea1nh m\u1ebd nh\u1ea5t. \u0110\xeam t\u1ed1i t\u0129nh m\u1ecbch l\xe0m tr\xf4i \u0111i s\u1ef1 xao l\xe3ng c\u1ee7a ban ng\xe0y, \u0111\u1ec3 l\u1ea1i cho ch\xfang ta c\u1ea3m gi\xe1c tr\u01a1 tr\u1ecdi v\u1edbi suy ngh\u0129 c\u1ee7a ch\xednh m\xecnh. \u0110\xe3 c\xf3 ai ch\u01b0a t\u1eebng th\u1ee9c th\u1ee9c d\u1eady v\xe0o 4 gi\u1edd s\xe1ng v\u1edbi \u0111\u1ea7y m\u1ed1i lo l\u1eafng kh\xf4ng th\u1ec3 g\u1ea1t b\u1ecf \u0111\u01b0\u1ee3c hay ch\u01b0a? L\xe1 b\xe0i 9 of Swords \u0111\u1ea1i di\u1ec7n cho s\u1ef1 b\u1ea5t h\u1ea1nh \u0111ang x\xe2m l\u1ea5n v\xe0o t\xe2m h\u1ed3n ch\xfang ta b\u1ea5t k\u1ef3 l\xfac n\xe0o.",60,"10 of Swords l\xe0 m\u1ed9t l\xe1 b\xe0i v\u1ec1 s\u1ef1 b\u1ea5t h\u1ea1nh kh\u1ee7ng khi\u1ebfp, nh\u01b0ng \u0111i\u1ec1u b\u1ea5t ng\u1edd l\xe0 n\xf3 l\u1ea1i th\u01b0\u1eddng \u0111\u1ea1i di\u1ec7n cho c\xe1c r\u1eafc r\u1ed1i mang t\xednh \u201cc\u1ea3i l\u01b0\u01a1ng\u201d h\u01a1n l\xe0 c\xf3 th\u1ef1c. Ng\u01b0\u1eddi \u0111\xe0n \xf4ng tr\xean l\xe1 b\xe0i n\xe0y b\u1ecb nhi\u1ec1u thanh ki\u1ebfm \u0111\xe2m tr\xean l\u01b0ng. Tr\xean th\u1ef1c t\u1ebf li\u1ec7u c\xf3 ng\u01b0\u1eddi n\xe0o c\xf3 th\u1ec3 ch\u1ecbu n\u1ed5i kh\xf4ng? Li\u1ec7u m\u01b0\u1eddi thanh ki\u1ebfm c\xf3 nhi\u1ec1u qu\xe1 hay kh\xf4ng? C\xf3 l\u1ebd n\u1ed7i \u0111au kh\u1ed5 c\u1ee7a ng\u01b0\u1eddi \u0111\xe0n \xf4ng n\xe0y, tuy \u0111\xe1ng c\u1ea3m th\xf4ng, ch\u1ec9 \u0111ang \u0111\u01b0\u1ee3c ph\xf3ng \u0111\u1ea1i l\xean th\xf4i.",61,"Page of Swords l\xe0 m\u1ed9t ng\u01b0\u1eddi truy\u1ec1n tin, anh ta mang l\u1ea1i cho b\u1ea1n nh\u1eefng th\xe1ch th\u1ee9c. Anh ta cho r\u1eb1ng b\u1ea1n s\u1ebd c\xf3 c\u01a1 h\u1ed9i \u0111\u1ec3 ph\xe1t tri\u1ec3n d\u01b0\u1edbi d\u1ea1ng m\u1ed9t v\u1ea5n \u0111\u1ec1 ho\u1eb7c m\u1ed9t t\xecnh hu\u1ed1ng kh\xf3 x\u1eed. Nh\u1eefng th\u1eed th\xe1ch n\xe0y c\xf3 th\u1ec3 kh\xf4ng ph\u1ea3i l\xe0 \u0111i\u1ec1u b\u1ea1n \u01b0a th\xedch. Th\u1ef1c t\u1ebf, c\xf3 l\u1ebd b\u1ea1n s\u1ebd mu\u1ed1n n\xf3i r\u1eb1ng \u201cC\xe1m \u01a1n, nh\u01b0ng t\xf4i kh\xf4ng c\u1ea7n ch\xfang\u201d.",62,'Trong gi\u1ea3i b\xe0i tarot, Knight of Swords th\u1ec3 hi\u1ec7n r\u1eb1ng phong th\xe1i s\u1eafc b\xe9n c\u1ee7a anh ta c\xf3 li\xean quan trong ho\xe0n c\u1ea3nh nh\u01b0 m\u1ed9t kh\xeda c\u1ea1nh c\u1ee7a b\u1ea1n, c\u1ee7a m\u1ed9t ai \u0111\xf3 kh\xe1c ho\u1eb7c c\u1ee7a m\u1ed9t b\u1ea7u kh\xf4ng kh\xed n\xf3i chung. B\u1ea1n c\u1ea7n t\u1ef1 h\u1ecfi ch\xednh m\xecnh \u201cLi\u1ec7u n\u0103ng l\u01b0\u1ee3ng c\u1ee7a v\u1ecb hi\u1ec7p s\u1ef9 (Knight) n\xe0y c\xf3 gi\xfap \xedch cho b\u1ea1n hay s\u1ebd khi\u1ebfn b\u1ea1n b\u1ecb t\u1ed5n th\u01b0\u01a1ng?".',63,"L\xe1 Queen n\xe0y \u0111\u1ea1i di\u1ec7n cho m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng hay ph\u1ee5 n\u1eef, ho\u1eb7c m\u1ed9t b\u1ea7u kh\xf4ng kh\xed giao ti\u1ebfp ch\xe2n th\u1ef1c v\xe0 th\u1eb3ng th\u1eafn. Trong gi\u1ea3i b\xe0i tarot, n\xe0ng cho b\u1ea1n bi\u1ebft r\u1eb1ng ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng \u0111\u1eb7c bi\u1ec7t c\u1ee7a n\xe0ng s\u1ebd r\u1ea5t c\xf3 \xedch cho b\u1ea1n v\xe0o th\u1eddi \u0111i\u1ec3m n\xe0y. H\xe3y \u0111\u1ec3 b\u1ea3n th\xe2n m\xecnh \u0111\u01b0\u1ee3c truy\u1ec1n c\u1ea3m h\u1ee9ng b\u1edfi Queen of Swords theo b\u1ea5t k\u1ef3 d\u1ea1ng th\u1ee9c n\xe0o m\xe0 n\xe0ng xu\u1ea5t hi\u1ec7n trong cu\u1ed9c s\u1ed1ng b\u1ea1n.",64,"Trong gi\u1ea3i b\xe0i tarot, King of Swords y\xeau c\u1ea7u b\u1ea1n c\xf3 nh\u1eefng h\xe0nh \u0111\u1ed9ng nh\u01b0 \xf4ng ta. V\xed d\u1ee5: n\xf3i s\u1ef1 th\u1eadt, suy ngh\u0129 ra m\u1ed9t gi\u1ea3i ph\xe1p, giao ti\u1ebfp t\u1ed1t, ho\u1eb7c \u0111\xe1nh gi\xe1 m\u1ed9t c\xe1ch c\xf4ng b\u1eb1ng. L\xe1 King of Swords c\u0169ng \u0111\u1ea1i di\u1ec7n m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng hay ph\u1ee5 n\u1eef \u0111ang h\xe0nh \u0111\u1ed9ng gi\u1ed1ng \xf4ng \u1ea5y, ho\u1eb7c m\u1ed9t b\u1ea7u kh\xf4ng kh\xed c\u1ee7a l\xfd l\u1ebd, trung th\u1ef1c v\xe0 nh\u1eefng ti\xeau chu\u1ea9n cao. Trong gi\u1ea3i b\xe0i, \xf4ng ta cho b\u1ea1n bi\u1ebft r\u1eb1ng n\u0103ng l\u01b0\u1ee3ng c\u1ee7a \xf4ng c\xf3 \xfd ngh\u0129a v\u1edbi b\u1ea1n trong th\u1eddi \u0111i\u1ec3m n\xe0y. H\xe3y \u0111\u1ec3 b\u1ea3n th\xe2n m\xecnh \u0111\u01b0\u1ee3c truy\u1ec1n c\u1ea3m h\u1ee9ng b\u1edfi l\xe1 King of Swords theo b\u1ea5t k\u1ef3 d\u1ea1ng th\u1ee9c n\xe0o \xf4ng \u1ea5y xu\u1ea5t hi\u1ec7n trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n.",65,"Ace of Wands l\xe0 m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ti\u1ec1m n\u0103ng trong l\u0129nh v\u1ef1c s\xe1ng t\u1ea1o, h\u1ee9ng th\xfa, phi\xeau l\u01b0u, l\xf2ng can \u0111\u1ea3m, s\u1ee9c m\u1ea1nh c\xe1 nh\xe2n. Trong gi\u1ea3i b\xe0i tarot, n\xf3 th\u1ec3 hi\u1ec7n r\u1eb1ng m\u1ed9t h\u1ea1t gi\u1ed1ng nhi\u1ec7t huy\u1ebft t\xe1o b\u1ea1o \u0111\xe3 \u0111\u01b0\u1ee3c \u01b0\u01a1ng m\u1ea7m trong cu\u1ed9c s\u1ed1ng b\u1ea1n m\u1eb7c d\xf9 b\u1ea1n ch\u01b0a th\u1ec3 nh\u1eadn ra n\xf3. Khi h\u1ea1t gi\u1ed1ng n\xe0y \u0111\xe2m ch\u1ed3i, n\xf3 c\xf3 th\u1ec3 tr\u1edf th\xe0nh m\u1ed9t tr\u1ea1ng th\xe1i b\u1ea5t k\u1ef3. N\xf3 c\xf3 th\u1ec3 l\xe0 m\u1ed9t \xfd t\u01b0\u1edfng s\xe1ng t\u1ea1o, s\u1ef1 d\xe2ng tr\xe0n l\u1ea1c quan ho\u1eb7c m\u1ed9t ham mu\u1ed1n h\xe0nh \u0111\u1ed9ng li\u1ec1u l\u0129nh. M\u1eb7t kh\xe1c, n\xf3 c\xf3 th\u1ec3 l\xe0 m\u1ed9t l\u1eddi \u0111\u1ec1 ngh\u1ecb, m\u1ed9t m\xf3n qu\xe0, c\u01a1 h\u1ed9i, cu\u1ed9c g\u1eb7p g\u1ee1 ho\u1eb7c m\u1ed9t s\u1ef1 ki\u1ec7n.",66,"L\xe1 b\xe0i 2 of Wands t\xf4n l\xean l\xf2ng can \u0111\u1ea3m v\xe0 t\xednh v\u0129 \u0111\u1ea1i c\u1ee7a m\u1ed9t ng\u01b0\u1eddi. L\xe1 b\xe0i n\xe0y c\xf3 c\xf9ng ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng v\u1edbi l\xe1 The Magician, nh\u01b0ng c\xf3 m\u1ed9t \u0111i\u1ec3m kh\xe1c bi\u1ec7t quan tr\u1ecdng. The Magician \u0111\u1ea1i di\u1ec7n cho nguy\xean m\u1eabu c\u1ee7a quy\u1ec1n l\u1ef1c \u2013 ngu\u1ed3n n\u0103ng l\u01b0\u1ee3ng kh\xf4ng bao h\xe0m c\xe1c y\u1ebfu t\u1ed1 c\xe1 nh\xe2n g\u1ed3m t\xednh s\xe1ng t\u1ea1o v\xe0 s\u1ee9c m\u1ea1nh. L\xe1 b\xe0i 2 of Wands \u0111\u1ea1i di\u1ec7n cho ngu\u1ed3n s\u1ee9c m\u1ea1nh t\u1eeb Tr\xe1i \u0111\u1ea5t \u0111\u01b0\u1ee3c nh\u1eadp truy\u1ec1n v\xe0o b\u1ea3n th\xe2n. S\u1ee9c m\u1ea1nh b\u1ea3n th\xe2n l\xe0 m\u1ed9t ngu\u1ed3n l\u1ef1c m\u1ea1nh m\u1ebd tr\xe0n ng\u1eadp trong b\u1ea1n v\xe0 cho b\u1ea1n s\u1ef1 can \u0111\u1ea3m \u0111\u1ec3 tr\u1edf n\xean v\u0129 \u0111\u1ea1i. M\u1ed9t ng\u01b0\u1eddi m\u1ea1nh m\u1ebd c\u0169ng gi\u1ed1ng nh\u01b0 m\u1ed9t th\u1ecfi nam ch\xe2m, thu h\xfat m\u1ecdi ng\u01b0\u1eddi kh\xe1c trong m\u1ed9t khu v\u1ef1c nh\u1ea5t \u0111\u1ecbnh.",67,"V\u1edbi 3 of Wands, ch\xfang ta th\u1ea5y m\u1ed9t ng\u01b0\u1eddi \u0111ang \u0111\u1ee9ng \u1edf m\u1ecfm n\xfai tr\xf4ng ra ph\xeda bi\u1ec3n h\u01b0\u1edbng \u0111\u1ebfn nh\u1eefng d\xe3y n\xfai ph\xeda xa xa. T\u1eeb \u0111\u1ed9 cao n\xe0y, anh ta th\u1ea5y m\u1ecdi th\u1ee9 \u1edf ph\xeda tr\u01b0\u1edbc. \u0110\xe2y l\xe0 l\xe1 b\xe0i v\u1ec1 t\u1ea7m nh\xecn v\xe0 d\u1ef1 \u0111o\xe1n tr\u01b0\u1edbc. Khi ch\xfang ta mu\u1ed1n nh\xecn th\u1ea5y xa h\u01a1n, ch\xfang ta s\u1ebd ph\u1ea3i leo cao h\u01a1n. B\u1eb1ng c\xe1ch \u0111i l\xean, ch\xfang ta t\u0103ng \u0111\u01b0\u1ee3c gi\u1edbi h\u1ea1n c\u1ee7a m\xecnh v\xe0 gi\u1ea3i tho\xe1t ch\xednh m\xecnh kh\u1ecfi ho\xe0n ho\xe0n c\u1ea3nh hi\u1ec7n t\u1ea1i. Ch\xfang ta t\xe1ch ra kh\u1ecfi t\xecnh th\u1ebf v\xe0 t\u1ea1o ra \u0111\u01b0\u1ee3c quan \u0111i\u1ec3m, c\xe1i nh\xecn c\u1ee7a m\xecnh.",68,"L\xe1 b\xe0i 4 of Wands th\u01b0\u1eddng mang ngh\u0129a t\u1ef1 do. T\u1ef1 do c\xf3 th\u1ec3 th\u1ec3 hi\u1ec7n \u1edf nhi\u1ec1u d\u1ea1ng, nh\u01b0ng lu\xf4n mang l\u1ea1i m\u1ed9t c\u1ea3m gi\xe1c vui v\u1ebb. Khi ch\xfang ta ph\xe1 v\u1ee1 xi\u1ec1ng x\xedch b\xf3 bu\u1ed9c m\xecnh, d\xf9 l\xe0 v\u1ec1 th\u1ec3 ch\u1ea5t, tinh th\u1ea7n hay c\u1ea3m x\xfac, ch\xfang ta \u0111\u1ec1u c\u1ea3m th\u1ea5y h\xe2n hoan v\xe0 c\xf3 th\u1ec3 b\u01b0\u1edbc l\xean m\u1ed9t giai \u0111o\u1ea1n ph\xe1t tri\u1ec3n v\xe0 h\u1ea1nh ph\xfac m\u1edbi. N\u1ebfu b\u1ea1n c\u1ea3m th\u1ea5y b\u1ecb b\xf3 bu\u1ed9c ho\u1eb7c gi\u1edbi h\u1ea1n \u1edf th\u1eddi \u0111i\u1ec3m hi\u1ec7n t\u1ea1i, h\xe3y s\u1eed d\u1ee5ng n\u0103ng l\u01b0\u1ee3ng c\u1ee7a 4 of Wands \u0111\u1ec3 ph\xf3ng th\xedch b\u1ea1n \u0111\u1ebfn t\u1ef1 do. \u0110\u1eebng ng\u1ea7n ng\u1ea1i y\xeau c\u1ea7u nh\u1eefng vi\u1ec5n c\u1ea3nh r\u1ed9ng m\u1edf v\u1ed1n thu\u1ed9c v\u1ec1 b\u1ea1n m\u1ed9t c\xe1ch ch\xednh \u0111\xe1ng.",69,"L\xe1 b\xe0i 5 of Wands \u0111\u1ea1i di\u1ec7n cho kho\u1ea3ng th\u1eddi gian m\xe0 ho\xe0n c\u1ea3nh nh\u01b0 \u0111ang ch\u1ed1ng l\u1ea1i b\u1ea1n. Kh\xf4ng c\xf3 \u0111i\u1ec1u g\xec trong cu\u1ed9c s\u1ed1ng b\u1ea1n \u0111ang di\u1ec5n ra m\u1ed9t c\xe1ch tr\xf4i ch\u1ea3y; m\u1ecdi ng\u01b0\u1eddi l\xe0m vi\u1ec7c v\u1edbi nh\u1eefng m\u1ee5c \u0111\xedch \u0111\u1ea7y m\u1eabu thu\u1eabn l\u1eabn nhau. Nh\u1eefng nh\xe2n v\u1eadt trong l\xe1 b\xe0i \u0111ang g\xe2y chi\u1ebfn v\u1edbi nhau. Kh\xf4ng c\xf3 b\u1ea5t k\u1ef3 n\u1ed7 l\u1ef1c h\u1ee3p t\xe1c hay s\u1ef1 \u0111\u1ed3ng thu\u1eadn n\xe0o xu\u1ea5t hi\u1ec7n \u1edf \u0111\xe2y c\u1ea3. Khi l\xe1 b\xe0i n\xe0y xu\u1ea5t hi\u1ec7n trong m\u1ed9t l\u01b0\u1ee3t tr\u1ea3i b\xe0i, l\u1eddi nh\u1eafn \u0111\u1ebfn b\u1ea1n l\xe0 h\xe3y chu\u1ea9n b\u1ecb cho m\u1ed9t qu\xe3ng \u0111\u01b0\u1eddng \u0111\u1ea7y cam go th\u1eed th\xe1ch s\u1eafp t\u1edbi. B\u1ea1n s\u1ebd c\u1ea7n ki\xean nh\u1eabn h\u01a1n \u0111\u1ec3 c\xf3 th\u1ec3 ho\xe0n th\xe0nh \u0111\u01b0\u1ee3c m\u1ecdi th\u1ee9. L\xe1 5 of Wands kh\xf4ng h\xe0m \xfd \u0111\u1ebfn nh\u1eefng ng\u0103n tr\u1edf l\u1edbn, m\xe0 ch\u1ec9 l\xe0 nhi\u1ec1u kh\xf3 kh\u0103n nh\u1ecf v\xe0 nh\u1eefng \u0111i\u1ec1u phi\u1ec1n to\xe1i th\xf4i.",70,"6 of Wands l\xe0 b\u1ea3n sao trong b\u1ed9 \u1ea9n ph\u1ee5 c\u1ee7a l\xe1 The Charot. C\u1ea3 hai l\xe1 b\xe0i n\xe0y \u0111\u1ec1u \u0111\u1ea1i di\u1ec7n cho nh\u1eefng kho\u1ea3nh kh\u1eafc chi\u1ebfn th\u1eafng. \u0110\xf4i khi trong cu\u1ed9c s\u1ed1ng, t\u1ea5t c\u1ea3 nh\u1eefng g\xec ch\xfang ta mu\u1ed1n l\xe0 s\u1ef1 chi\u1ebfn th\u1eafng \u2013tr\u1edf th\xe0nh ng\u01b0\u1eddi ng\u1ef1 tr\xean \u0111\u1ec9nh, tr\u1edf th\xe0nh s\u1ed1 m\u1ed9t. B\u1ea1n c\xf3 th\u1ec3 th\u1ea5y \u01b0\u1edbc m\u01a1 n\xe0y ph\u1ea3ng ph\u1ea5t tr\xean g\u01b0\u01a1ng m\u1eb7t c\u1ee7a c\xe1c v\u1eadn \u0111\u1ed9ng vi\xean, ch\xednh tr\u1ecb gia, v\xe0 nh\u1eefng ng\u01b0\u1eddi chi\u1ebfn th\u1eafng kh\xe1c khi h\u1ecd b\u01b0\u1edbc l\xean \u0111\xe0i vinh danh. N\xf3 l\xe0 c\u1ea3m gi\xe1c \u0111\xe1ng gi\xe1 nh\u1ea5t trong m\u1ecdi th\u1ee9. T\xf4i l\xe0 nh\u1ea5t. T\xf4i \u0111\xe3 chi\u1ebfn th\u1eafng!",71,"L\xe1 b\xe0i 7 of Wands n\xf3i v\u1ec1 vi\u1ec7c \u0111\u1ee9ng l\xean chi\u1ebfn \u0111\u1ea5u. \u0110\u1ee9ng l\xean chi\u1ebfn \u0111\u1ea5u l\xe0 m\u1ed9t h\xe0nh \u0111\u1ed9ng m\u1ea1nh m\u1ebd, c\xf3 th\u1ec3 khi\u1ebfn d\xf2ng n\u0103ng l\u01b0\u1ee3ng c\u1ee7a th\u1ebf gi\u1edbi thay \u0111\u1ed5i theo chi\u1ec1u h\u01b0\u1edbng t\u1ed1t ho\u1eb7c x\u1ea5u. H\u1ea7u h\u1ebft th\u1eddi gian ch\xfang ta tr\xf4i theo d\xf2ng \u0111\u1eddi. C\xe1c s\u1ef1 ki\u1ec7n v\xe0 c\u1ea3m gi\xe1c mang ch\xfang ta ti\u1ebfn l\xean v\u1edbi ch\u1ec9 c\u1ea7n m\u1ed9t \xedt n\u1ed7 l\u1ef1c. D\xf9 v\u1eady, \u0111\xf4i khi ch\xfang ta kh\xf4ng b\u1eb1ng l\xf2ng v\u1edbi vi\u1ec7c \u0111\u1ec3 b\u1ecb tr\xf4i \u0111i m\xe3i. Ch\xfang ta mu\u1ed1n kh\xe1ng l\u1ea1i d\xf2ng ch\u1ea3y, ho\u1eb7c thay \u0111\u1ed5i to\xe0n b\u1ed9 h\u01b0\u1edbng \u0111i.",72,"Trong gi\u1ea3i b\xe0i tarot, l\xe1 8 of Wands th\u01b0\u1eddng l\xe0 d\u1ea5u hi\u1ec7u cho bi\u1ebft hi\u1ec7n t\u1ea1i l\xe0 th\u1eddi \u0111i\u1ec3m \u0111\u1ec3 b\u1ed9c l\u1ed9 b\u1ea3n th\xe2n b\u1ea1n. M\u1ecdi y\u1ebfu t\u1ed1 \u0111\u1ec1u \u0111ang s\u1eb5n s\xe0ng v\xe0 s\u1ebd di\u1ec5n bi\u1ebfn t\u1ed1t n\u1ebfu nh\u01b0 b\u1ea1n kh\xf4ng ch\u1ea7n ch\u1eeb. H\xe3y n\u1eafm l\u1ea5y c\u01a1 h\u1ed9i! N\u1ebfu nh\u1eefng s\u1ef1 ki\u1ec7n \u0111ang b\u1eaft \u0111\u1ea7u, ch\xfang s\u1ebd di\u1ec5n ra m\u1ed9t c\xe1ch nhanh ch\xf3ng. B\u1ea1n c\xf3 th\u1ec3 c\u1ea3m th\u1ea5y nh\u01b0 b\u1ecb cu\u1ed1n theo m\u1ed9t c\u01a1n l\u1ed1c, nh\u01b0ng b\u1ee5i s\u1ebd l\u1eafng xu\u1ed1ng nhanh th\xf4i, v\xe0 r\u1ed3i khi \u0111\xf3 b\u1ea1n s\u1ebd th\u1ea5y k\u1ebf hoach c\u1ee7a m\xecnh \u0111\xe3 di\u1ec5n ra nh\u01b0 th\u1ebf n\xe0o.",73,"H\xecnh t\u01b0\u1ee3ng c\u1ee7a nh\xe2n v\u1eadt trong 9 of Wands ph\u1ea3ng ph\u1ea5t r\u1ea5t r\xf5 r\xe0ng n\xe9t b\u1ec1n b\u1ec9 tr\u01b0\u1edbc c\u01a1n b\u0129 c\u1ef1c. \u0110\u1ea7u v\xe0 tay anh ta qu\u1ea5n b\u0103ng, v\xe0 anh ta d\u1ef1a ng\u01b0\u1eddi v\xe0o m\u1ed9t chi\u1ebfc n\u1ea1ng. Ng\u01b0\u1eddi l\xednh n\xe0y \u0111\xe3 tr\u1ea3i qua m\u1ed9t v\xe0i cu\u1ed9c chi\u1ebfn, nh\u01b0ng anh ta v\u1eabn ki\xean tr\xec! Anh \u0111au \u0111\u1edbn, nh\u01b0ng anh kh\xf4ng g\u1ee5c ng\xe3. Khi ch\xfang ta \u0111\xe3 c\xf3 m\u1ed9t tr\u1ea3i nghi\u1ec7m x\u1ea5u, ch\xfang ta c\u1ea3m th\u1ea5y m\u1ec7t m\u1ecfi v\xe0 s\u1ee3 h\xe3i nh\u1eefng xung \u0111\u1ed9t. Ngay c\u1ea3 khi ch\xfang ta kh\xf4ng c\u1ea3m th\u1ea5y \u0111au \u0111\u1edbn v\u1ec1 m\u1eb7t th\u1ec3 x\xe1c, th\xec \xedt nhi\u1ec1u tinh th\u1ea7n ch\xfang ta c\u0169ng b\u1ecb t\u1ed5n th\u01b0\u01a1ng. L\xf2ng c\u1edfi m\u1edf, s\u1ef1 ng\xe2y th\u01a1 v\xe0 ni\u1ec1m tin c\u1ee7a ch\xfang ta kh\xf4ng c\xf2n n\u1eefa, m\xe0 thay v\xe0o \u0111\xf3 l\xe0 t\u01b0 t\u01b0\u1edfng ph\xf2ng v\u1ec7 v\xe0 c\u1ea3nh gi\xe1c.",74,"Tr\xean l\xe1 b\xe0i 10 of Wands, ch\xfang ta th\u1ea5y m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng \u0111ang v\u1ea5t v\u1ea3 c\u1ed1 g\u1eafng mang v\xe1c t\u1edbi m\u01b0\u1eddi c\xe2y g\u1ed7 n\u1eb7ng. Ch\xfang \u0111\u01b0\u1ee3c x\u1ebfp s\xe1t nhau ph\xeda tr\u01b0\u1edbc anh ta \u0111\u1ebfn n\u1ed7i anh ta th\u1eadm ch\xed kh\xf4ng th\u1ec3 nh\xecn th\u1ea5y \u0111\u01b0\u1eddng \u0111i. \u1ede ng\u01b0\u1eddi \u0111\xe0n \xf4ng n\xe0y ch\u1eb3ng c\xf3 g\xec kh\xe1c to\xe1t l\xean ngo\u1ea1i tr\u1eeb g\xe1nh n\u1eb7ng v\xe0 tr\xe1ch nhi\u1ec7m c\u1ee7a anh ta. \u0110\xf3 l\xe0 ph\u1ea3i l\xe0 m\u1ed9t th\u1ef1c t\u1ebf c\u1ee7a ng\xe0y h\xf4m nay! Ch\xfang ta \xf4m qu\xe1 nhi\u1ec1u vi\u1ec7c, c\u1ed1 g\u1eafng l\xe0m m\u1ecdi th\u1ee9 m\xecnh mu\u1ed1n. Ch\xfang ta ngh\u0129 r\u1eb1ng n\u1ebfu ch\xfang ta c\xf3 th\u1ec3 b\xe1m tr\u1ee5 \u0111\u01b0\u1ee3c \u0111\u1ebfn cu\u1ed1i tu\u1ea7n (ho\u1eb7c ng\xe0y ngh\u1ec9 l\u1ec5, ho\u1eb7c k\u1ebft th\xfac m\u1ed9t kh\xf3a h\u1ecdc) th\xec ch\xfang ta c\xf3 th\u1ec3 \u0111\u01b0\u1ee3c ngh\u1ec9 ng\u01a1i. V\xe0 r\u1ed3i cu\u1ed1i tu\u1ea7n \u0111\u1ebfn, k\u1ef3 ngh\u1ec9 qua \u0111i, m\xe0 n\xfai c\xf4ng vi\u1ec7c v\u1eabn c\xf2n \u0111\xf3.",75,"L\xe1 b\xe0i Page of Wands l\xe0 m\u1ed9t th\xf4ng \u0111i\u1ec7p mang \u0111\u1ebfn cho b\u1ea1n nh\u1eefng c\u01a1 h\u1ed9i v\u1ec1 ni\u1ec1m \u0111am m\xea. Nh\xe2n v\u1eadt trong l\xe1 b\xe0i \u0111\u01b0a ra nh\u1eefng c\u01a1 h\u1ed9i th\u1ef1c s\u1ef1 \u0111\u1ec3 tr\u1ea3i nghi\u1ec7m t\xednh s\xe1ng t\u1ea1o, can \u0111\u1ea3m, \u0111am m\xea v\xe0 ngu\u1ed3n c\u1ea3m h\u1ee9ng \u2013 nh\u1eefng \u0111\u1eb7c tr\u01b0ng k\u1ef3 di\u1ec7u t\u1eeb b\u1ed9 Wands. Trong gi\u1ea3i b\xe0i tarot, l\xe1 Page of Wands g\u1ee3i \xfd r\u1eb1ng m\u1ed9t c\u01a1 h\u1ed9i c\xf3 kh\u1ea3 n\u0103ng x\u1ea3y ra s\u1ebd t\u1ea1o cho b\u1ea1n ni\u1ec1m ph\u1ea5n kh\xedch, b\u1ed3i d\u01b0\u1ee1ng c\xe1c t\xe0i n\u0103ng c\u1ee7a b\u1ea1n, ho\u1eb7c th\xe1ch th\u1ee9c b\u1ea1n \u0111\u1ea1t \u0111\u01b0\u1ee3c nh\u1eefng m\u1ee5c ti\xeau l\u1edbn h\u01a1n. Khi b\u1ea1n th\u1ea5y \u0111\u01b0\u1ee3c c\u01a1 h\u1ed9i nh\u01b0 v\u1eady, h\xe3y n\u1eafm b\u1eaft l\u1ea5y!",76,"Trong gi\u1ea3i b\xe0i tarot, l\xe1 Knight of Wands th\u1ec3 hi\u1ec7n r\u1eb1ng phong c\xe1ch t\u1ef1 tin v\xe0 nhi\u1ec7t huy\u1ebft c\u1ee7a nh\xe2n v\u1eadt hi\u1ec7p s\u1ef9 trong l\xe1 b\xe0i c\xf3 m\u1ed1i li\xean h\u1ec7 v\u1edbi t\xecnh c\u1ea3nh c\u1ee7a c\xe1 nh\xe2n b\u1ea1n, ho\u1eb7c c\u1ee7a m\u1ed9t ai \u0111\xf3 kh\xe1c ho\u1eb7c c\u1ee7a m\u1ed9t b\u1ea7u kh\xf4ng kh\xed n\xf3i chung. B\u1ea1n c\u1ea7n t\u1ef1 h\u1ecfi ch\xednh m\xecnh r\u1eb1ng \u201cLi\u1ec7u n\u0103ng l\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi hi\u1ec7p s\u1ef9 n\xe0y s\u1ebd \u0111em l\u1ea1i nh\u1eefng \xedch l\u1ee3i hay s\u1ebd l\xe0m t\u1ed5n th\u01b0\u01a1ng b\u1ea1n?\u201d.",77,"Nh\xe2n c\xe1ch c\u1ee7a Queen of Wands k\u1ebft h\u1ee3p n\u0103ng l\u01b0\u1ee3ng t\xedch c\u1ef1c c\u1ee7a nguy\xean t\u1ed1 L\u1eeda c\u1ee7a b\u1ed9 Wands v\u1edbi t\xe2m \u0111i\u1ec3m h\u01b0\u1edbng v\xe0o b\xean trong c\u1ee7a nh\xe2n v\u1eadt Queen. N\xe0ng \u0111\u01b0\u1ee3c t\xf4n s\xf9ng l\xe0 ng\u01b0\u1eddi n\u1ed5i ti\u1ebfng nh\u1ea5t trong t\u1ea7ng l\u1edbp c\u1ee7a m\xecnh. N\xe0ng lu\xf4n h\u1ea5p d\u1eabn v\xe0 c\xf3 m\u1ed9t v\xe8 ngo\xe0i b\u1eaft m\u1eaft theo phong th\xe1i c\u1ed5 \u0111i\u1ec3n. N\u1ee5 c\u01b0\u1eddi \u1ea5m \xe1p c\u1ee7a n\xe0ng v\xe0 th\xe1i \u0111\u1ed9 d\u1ecbu d\xe0ng lu\xf4n mang l\u1ea1i cho n\xe0ng r\u1ea5t nhi\u1ec1u b\u1ea1n n\xe8 v\xe0 ng\u01b0\u1eddi h\xe2m m\u1ed9. N\u0103ng l\u01b0\u1ee3ng v\xe0 nhi\u1ec7t huy\u1ebft c\u1ee7a n\xe0ng lan t\u1ecfa. Cho d\xf9 nhi\u1ec7m v\u1ee5 l\xe0 g\xec, n\xe0ng \u0111\u1ec1u thi h\xe0nh v\u1edbi t\xe2m huy\u1ebft v\xe0 t\u1eadn t\xe2m. Kh\xf4ng g\xec c\xf3 th\u1ec3 l\xe0m n\xe0ng n\u1ea3n ch\xed.",78,"Trong gi\u1ea3i b\xe0i tarot, King of Wands y\xeau c\u1ea7u b\u1ea1n c\xf3 nh\u1eefng h\xe0nh \u0111\u1ed9ng trong kh\u1ea3 n\u0103ng. V\xed d\u1ee5, t\u1ea1o ra nh\u1eefng ki\u1ec7t t\xe1c, l\xe0m ng\u01b0\u1eddi d\u1eabn \u0111\u1ea7u, \u0111\u01b0\u01a1ng \u0111\u1ea7u v\u1edbi r\u1ee7i ro, ho\u1eb7c t\u1ea1o s\u1ef1 ch\xfa \xfd. L\xe1 King n\xe0y c\u0169ng c\xf3 th\u1ec3 \u0111\u1ea1i di\u1ec7n cho m\u1ed9t ng\u01b0\u1eddi \u0111\xe0n \xf4ng ho\u1eb7c ph\u1ee5 n\u1eef \u0111ang c\xf3 nh\u1eefng h\xe0nh \u0111\u1ed9ng gi\u1ed1ng nh\u01b0 v\u1eady, ho\u1eb7c m\xf4 t\u1ea3 m\u1ed9t b\u1ea7u kh\xf4ng kh\xed h\xe0o h\u1ee9ng, t\xe1o b\u1ea1o v\xe0 k\u1ecbch t\xednh. Trong m\u1ed9t l\u01b0\u1ee3t gi\u1ea3i b\xe0i, \xf4ng \u1ea5y cho b\u1ea1n bi\u1ebft r\u1eb1ng d\xf2ng n\u0103ng l\u01b0\u1ee3ng \u0111\u1eb7c bi\u1ec7t c\u1ee7a \xf4ng l\xe0 \u0111i\u1ec1u r\u1ea5t c\xf3 \xedch cho b\u1ea1n l\xfac n\xe0y. H\xe3y \u0111\u1ec3 b\u1ea3n th\xe2n m\xecnh \u0111\u01b0\u1ee3c truy\u1ec1n c\u1ea3m h\u1ee9ng b\u1edfi King of Wands theo b\u1ea5t c\u1ee9 d\u1ea1ng th\u1ee9c n\xe0o khi \xf4ng \u1ea5y xu\u1ea5t hi\u1ec7n trong cu\u1ed9c s\u1ed1ng c\u1ee7a b\u1ea1n."],t.nm,A.O("p*"))
